text = {
	["Default"] = { name = "-", desc = "Kit de peinture sans nom" },
	["so_yellow"] = { name = "Bulldozer", desc = "Des parties de cette arme ont été peintes selon un jeu de couleurs d'une chaîne de production jaune.\n\nCe broyeur d'os est un dévastateur" },
	["so_olive"] = { name = "Groundwater", desc = "Des parties de cette arme ont été peintes selon un jeu de couleurs vert olive." },
	["so_red"] = { name = "Pomme d'amour", desc = "Des parties de cette arme ont été bombées en rouge et noir.\n\nUne finition de choix pour les voitures, mais qui rend encore mieux sur des armes" },
	["so_purple"] = { name = "Ultraviolet", desc = "Des parties de cette arme ont été peintes selon un jeu de couleurs noir et violet.\n\nUn design élégant associé d'intentions brutales" },
	["so_night"] = { name = "Nuit", desc = "Des parties de cette arme ont été peintes selon un jeu de couleurs night ops.\n\nC'est le bruissement du vent... C'est la morsure sur ton cou" },
	["so_caramel"] = { name = "Caramel", desc = "Des parties de cette arme ont été peintes à la bombe selon des couleurs unies caramel et noir." },
	["so_grassland"] = { name = "Pâturage", desc = "Des parties de cette arme ont été peintes à la bombe selon un jeu de couleurs unies pâturage." },
	["so_moss"] = { name = "Sapin bleu", desc = "Des parties de cette arme ont été peintes selon un jeu de couleurs mousse." },
	["so_sand"] = { name = "Dune de sable", desc = "Des parties de cette arme ont été peintes selon un jeu de couleurs dune de sable.\n\nDepuis que Turner est mort, nous avons un nouvel objectif : secourir Alex Kincaide - Felix Riley, Commandant" },
	["so_stormfront"] = { name = "Tempête", desc = "Des parties de cette arme ont été peintes selon un jeu de couleurs orageux.\n\nIl t'attendra au monorail" },
	["so_tornado"] = { name = "Tornade", desc = "Des parties de cette arme ont été peintes selon un jeu de couleurs unies aux allures de tornade.\n\nNe te fie pas à son apparente simplicité" },
	["so_whiteout"] = { name = "Blanco", desc = "Cette arme a été entièrement recouverte de peinture blanche.\n\nIl a l'air pur, mais les apparences sont parfois trompeuses" },
	["so_jungle"] = { name = "Jungle", desc = "Des parties de cette arme ont été peintes selon un jeu de couleurs jungle." },
	["so_space_marine"] = { name = "Colonie", desc = "Des parties de cette arme ont été peintes en kaki et en gris." },
	["so_pmc"] = { name = "Fournisseur", desc = "Des parties de cette arme ont été peintes avec des couleurs ocre, marine et vert foncé.\n\nRona Sabri en veut encore à Sebastien de ne pas l'avoir choisie pour partir à la poursuite de Turner" },
	["so_tangerine"] = { name = "Démolition", desc = "Des parties de cette arme ont été peintes à la bombe en noire et orange tangerine.\n\nRona est aussi douée qu'elle le pense... Elle est simplement trop jeune pour se rendre compte qu'elle ne devrait pas le dire à tout le monde - Felix Riley, Commandant" },
	["so_orange_accents"] = { name = "Nitro", desc = "so_orange_accents" },
	["cu_broken_path_famas"] = { name = "Afterimage", desc = "Cette arme a été personnalisée avec des trainées de rubans." },
	["cu_bullet_rain_m4a1"] = { name = "Pluie de balles", desc = "Cette arme a été personnalisée d'une image de nuages pleuvant des balles." },
	["cu_catskulls_p90"] = { name = "Death by Kitty", desc = "Cette arme a été personnalisée en utilisant un film hydrographique avec des crânes de chat se chevauchant." },
	["CSGO_Doomkitty"] = { name = "Doomkitty", desc = "CSGO_Doomkitty" },
	["hy_ddpat"] = { name = "Tempéré numérique", desc = "Cette arme a été personnalisée en utilisant un film hydrographique d'un camouflage numérique.\n\nAu moment où tu es assez proche pour remarquer les pixels, c'est déjà trop tard" },
	["hy_ddpat_urb"] = { name = "Urbain numérique", desc = "hy_ddpat_urb" },
	["hy_ddpat_jungle"] = { name = "Jungle numérique", desc = "hy_ddpat_jungle" },
	["hy_ddpat_orange"] = { name = "Orange numérique", desc = "hy_ddpat_orange" },
	["hy_ddpat_pink"] = { name = "Rose numérique", desc = "hy_ddpat_pink" },
	["hy_ddpat_desert"] = { name = "Désert numérique", desc = "hy_ddpat_desert" },
	["hy_arctic"] = { name = "Camouflage arctique", desc = "Cette arme a été peinte avec une peinture hydrographique sur le thème du camouflage arctique.\n\nLa neige est glacée, mais la mort l'est bien plus encore" },
	["hy_dive"] = { name = "Camouflage profondeur", desc = "Cette arme a été personnalisée en utilisant un film hydrographique d'un camouflage bleu.\n\nNotre monde cache beaucoup de choses... mais parfois le camouflage est destiné à être vu - Booth, Marchand d'armes" },
	["hy_ocean"] = { name = "Eau vive", desc = "hy_ocean" },
	["hy_forest"] = { name = "Camouflage boisé", desc = "Cette arme a été personnalisée en utilisant un film hydrographique d'un camouflage tempéré.\n\nLes bois peuvent être un endroit dangereux... Ne voyage jamais seul" },
	["hy_forest_winter"] = { name = "Forêt hivernale", desc = "hy_forest_winter" },
	["hy_forest_boreal"] = { name = "Forêt boréale", desc = "hy_forest_boreal" },
	["hy_forest_night"] = { name = "Nuit forestière", desc = "hy_forest_night" },
	["hy_desert"] = { name = "Tempête du désert", desc = "Cette arme a été personnalisée en utilisant un film hydrographique d'un camouflage aride." },
	["hy_tiger"] = { name = "Tigre du Bengale", desc = "Cette arme a été personnalisée en utilisant un film hydrographique de rayures de tigre." },
	["hy_copperhead"] = { name = "Vipère cuivrée", desc = "Cette arme a été personnalisée en utilisant un film hydrographique aux motifs d'une peau de serpent cuivré." },
	["hy_skulls"] = { name = "Crânes", desc = "Cette arme a été personnalisée en utilisant un film hydrographique aux motifs de crânes avec des accentuations noires et rouges.\n\nUne fosse commune qui tient dans la paume de la main" },
	["hy_webs"] = { name = "Toile pourpre", desc = "Cette arme a été personnalisée en utilisant un film hydrographique aux motifs de toiles d'araignée sur la base d'une couche de rouge et avec une couche semi-brillante pour finition.\n\nAttention où tu mets les pieds, on ne sait jamais où la toile est tissée" },
	["hy_splatter"] = { name = "Trainées bleues", desc = "Cette arme a été personnalisée en utilisant un film hydrographique semi-transparent d'un motif d'éclaboussures sur la base d'une couche de bleu turquoise." },
	["hy_ak47lam"] = { name = "Rouge stratifié", desc = "Cette arme possède une crosse et un garde-main en bois stratifié." },
	["hy_ak47lam_bw"] = { name = "Noir stratifié", desc = "hy_ak47lam_bw" },
	["hy_ak47lam_blue"] = { name = "Bleu stratifié", desc = "hy_ak47lam_blue" },
	["hy_gelpen"] = { name = "Gunsmoke", desc = "Cette arme a été personnalisée en utilisant un film hydrographique d'un doodle fait au crayon." },
	["hy_v_tiger"] = { name = "Tigre de la jungle", desc = "Cette arme a été personnalisée en utilisant un film hydrographique d'un tigre de la jungle." },
	["hy_redtiger"] = { name = "Sang de tigre", desc = "hy_redtiger" },
	["hy_zombie"] = { name = "Virus", desc = "Cette arme a été personnalisée en utilisant un film hydrographique sur la base d'une couche de vert." },
	["hy_granite"] = { name = "Granit marbré", desc = "Cette arme a été peinte selon un motif marbré." },
	["hy_blizzard"] = { name = "Blizzard marbré", desc = "hy_blizzard" },
	["hy_sediment"] = { name = "Bourbier", desc = "hy_sediment" },
	["hy_reef_rock"] = { name = "Éclaboussure cyanosée", desc = "hy_reef_rock" },
	["sp_spray"] = { name = "Spray contrasté", desc = "Cette arme a été peinte à la main avec de courtes et épaisses lignes de couleurs contrastées.\n\nParfait pour les insurgés pressés" },
	["sp_spray_sage"] = { name = "Spray sauge", desc = "sp_spray_sage" },
	["sp_spray_jungle"] = { name = "Spray jungle", desc = "sp_spray_jungle" },
	["sp_spray_sand"] = { name = "Spray sable", desc = "sp_spray_sand" },
	["sp_spray_waves"] = { name = "Spray ondulé", desc = "sp_spray_waves" },
	["sp_tape_dots"] = { name = "Saison sèche", desc = "Cette arme a été peinte à la bombe avec des pochoirs tel que du ruban adhésif déchiré et du métal perforé." },
	["sp_tape_dots_urban"] = { name = "Perforation urbaine", desc = "sp_tape_dots_urban" },
	["sp_tape_dots_waves"] = { name = "Vagues perforées", desc = "sp_tape_dots_waves" },
	["sp_leaves"] = { name = "Feuillage forestier", desc = "Cette arme a été peinte à la bombe avec des pochoirs tel que des feuilles." },
	["sp_leaves_grassland"] = { name = "Feuillage de pâturage", desc = "sp_leaves_grassland" },
	["sp_short_tape"] = { name = "Pointillage lichen", desc = "Cette arme a été peinte à la bombe avec des pochoirs tel que de petits morceaux de ruban adhésif." },
	["sp_short_tape_jungle"] = { name = "Pointillage jungle", desc = "sp_short_tape_jungle" },
	["sp_short_tape_sand"] = { name = "Pointillage sablé", desc = "sp_short_tape_sand" },
	["sp_short_tape_urban"] = { name = "Pointillage urbain", desc = "sp_short_tape_urban" },
	["sp_tape"] = { name = "Masque osseux", desc = "Cette arme a été peinte à la bombe à l'aide d'un enchevêtrement de ruban adhésif utilisé comme un pochoir.\n\nLe vrai pouvoir se montre de manière subtile" },
	["sp_tape_orange"] = { name = "Peau d'orange", desc = "sp_tape_orange" },
	["sp_tape_urban"] = { name = "Masque urbain", desc = "sp_tape_urban" },
	["sp_mesh"] = { name = "Maillage bois flotté", desc = "Cette arme a été peinte à la bombe avec des pochoirs tel que du grillage à maille serrée et du carton découpé.\n\nUn prédateur est un prédateur, peu importe l'environnement" },
	["sp_mesh_tan"] = { name = "Maillage safari", desc = "sp_mesh_tan" },
	["sp_mesh_arctic_contrast"] = { name = "Maillage polaire", desc = "sp_mesh_arctic_contrast" },
	["sp_mesh_fire"] = { name = "Condamné", desc = "sp_mesh_fire" },
	["sp_mesh_glacier"] = { name = "Maillage glacier", desc = "sp_mesh_glacier" },
	["sp_mesh_sand"] = { name = "Maillage sableux", desc = "sp_mesh_sand" },
	["sp_snake"] = { name = "Camouflage serpent", desc = "Cette arme a été peinte en utilisant des morceaux de peaux de serpents dont les contours ont été tracé à la main." },
	["an_silver"] = { name = "Argent", desc = "Cette arme a été peinte avec de la peinture transparente argent à effet anodisé sur la base d'une couche de chrome.\n\nIl y a de la beauté dans la simplicité - Franz Kriegeld, Tacticien Phoenix" },
	["an_red"] = { name = "Hot rod", desc = "Cette arme a été peinte avec de la peinture transparente rouge à effet anodisé sur la base d'une couche de chrome.\n\nAutomatique. Systématique. Hydromatique" },
	["an_gunmetal"] = { name = "Gunmetal anodisé", desc = "an_gunmetal" },
	["an_navy"] = { name = "Bleu anodisé", desc = "Cette arme a été peinte avec de la peinture transparente bleu marine à effet anodisé sur la base d'une couche de chrome." },
	["am_urban"] = { name = "Métallique numérique", desc = "Cette arme a été personnalisée en utilisant un film hydrographique d'un camouflage numérique urbain sur la base d'une couche métallique." },
	["am_tiger"] = { name = "Tigre doré", desc = "Cette arme a été plaqué or et gravé à la main selon un motif tigré." },
	["am_dragon_glock"] = { name = "Décalco de dragon", desc = "Cette arme a été personnalisée en utilisant un autocollant de dragon sur la base d'une couche métallique.\n\nDans les contes de fée, le chevalier tue toujours le dragon... Mais nous sommes dans le monde réel - Valeria Jenner, Révolutionnaire" },
	["am_caustics"] = { name = "Caustique", desc = "Cette arme a été personnalisée en utilisant un film hydrographique rouge et blanc sur la base d'une couche en charbon métallique." },
	["am_lightning_awp"] = { name = "Éclair foudroyant", desc = "Cette arme a été personnalisée d'après un motif d'un éclair en utilisant des peintures anodisées sur la base d'une couche métallique.\n\nParfois il n'est pas nécessaire de frapper le même endroit deux fois" },
	["am_ossify"] = { name = "Sclérosé", desc = "Cette arme a été personnalisée en utilisant un film hydrographique citron vert transparent sur la base d'une couche métallique." },
	["aa_flames"] = { name = "Flamme", desc = "Cette arme a été peinte à l'aérographe avec des peintures transparentes sur la base d'une couche de chrome." },
	["aa_splash_p250"] = { name = "Splash", desc = "Cette arme a été peinte à l'aérographe avec des peintures transparentes sur la base d'une couche de chrome." },
	["aa_fade"] = { name = "Dégradé", desc = "Cette arme a été peinte à l'aérographe avec des peintures transparentes sur la base d'une couche de chrome.\n\nCe n'est pas qu'une arme, c'est aussi un sujet de conversation - Imogen, trafiquante d'armes en formation" },
	["aa_fade_metallic"] = { name = "Dégradé ambré", desc = "aa_fade_metallic" },
	["aa_fade_grassland"] = { name = "Dégradé acide", desc = "aa_fade_grassland" },
	["aq_copper"] = { name = "Cuivré", desc = "Cette arme a été recouverte de cuivre." },
	["aq_blued"] = { name = "Acier bleui", desc = "Cette arme a été bleuie à froid.\n\nC'est le Malbec du design d'arme - Booth, Marchand d'armes" },
	["aq_forced"] = { name = "Tacheté", desc = "La couleur de cette arme a été obtenue grâce à du citron et de la moutarde égouttés sur sa surface.\n\nSi tu crois déjà que c'est sale, attends de le voir sous lumière ultra-violette" },
	["aq_oiled"] = { name = "Cémenté", desc = "Cette arme a été cémentée en appliquant du charbon de bois à température élevée.\n\nUn peu de couleur n'a jamais fait de mal" },
	["sp_spitfire_famas"] = { name = "Spitfire", desc = "sp_spitfire_famas" },
	["am_zebra"] = { name = "Carnage", desc = "Cette arme a été peinte selon un motif zébré avec des peintures aluminium et chrome réflectives, puis elle a ensuite été recouverte d'une couche de rouge bonbon.\n\nValeria ne paye pas Javier pour poser des questions... Elle le paye pour forcer des réponses" },
	["am_zebra_dark"] = { name = "Eau sombre", desc = "Cette arme a été peinte selon un motif de bandes aquatiques avec des peintures charbon métalliques réflectives sur la base d'une couche de chrome.\n\nL'eau donne la vie, mais elle peut aussi la prendre..." },
	["aa_vertigo"] = { name = "Hypnotique", desc = "Cette arme a été peinte sur la base d'une couche perle, puis peinte à la bombe noire en utilisant un pochoir d'un motif graphique.\n\nTu ne t'endors pas, tu t'évanouies à cause du sang perdu" },
	["cu_spring_nova"] = { name = "Bloomstick", desc = "Cette arme a été peinte à l'aérographe d'après un motif de fleurs de cerisier puis elle a reçue une couche de finition très brillante." },
	["sp_hazard"] = { name = "Danger", desc = "sp_hazard" },
	["aq_rust"] = { name = "Rouillé", desc = "Bien qu'elle a l'air rouillée, cette arme est en parfait état de marche." },
	["am_slither_p90"] = { name = "Sang froid", desc = "Cette arme a été peinte avec de la peinture transparente rouge à effet anodisé sur la base d'une couche de chrome. Elle a ensuite été gravée au laser avec le motif d'un serpent rampant." },
	["am_carbon_fiber"] = { name = "Fibre de carbone", desc = "Cette arme a été personnalisée en utilisant un film hydrographique de fibre de carbone sur la base d'une couche en graphite.\n\nSimplement parce que j'ai porté mon équipe ne veut pas dire que ce n'était pas effort collectif - Rona Sabri, Étoile Montante" },
	["am_scorpion_p2000"] = { name = "Scorpion", desc = "Cette arme a été peinte en utilisant des peintures à effets anodisés selon un motif ondulé et un autocollant d'un scorpion rouge sur la crosse." },
	["hy_feathers_aug"] = { name = "Ailé", desc = "Cette arme a été personnalisée avec des décalques de plumes d'aigle.\n\nUn aigle parait majestueux jusqu'à ce qu'il t'arrache les yeux" },
	["sp_palm_shadow"] = { name = "Tempête tropicale", desc = "sp_palm_shadow" },
	["cu_walnut_nova"] = { name = "Noyer", desc = "Cette arme possède une crosse façonnée en noyer." },
	["aq_brass"] = { name = "Laiton", desc = "Des parties de cette arme ont été remplacées par du cuivre.\n\nTrésor de pacotille" },
	["hy_blam"] = { name = "BADABOUM !", desc = "Cette arme a été personnalisée en utilisant un film hydrographique imprimé avec des onomatopées de comics sur la base d'une couche d'orange." },
	["hy_blam_simple"] = { name = "BOUM", desc = "hy_blam_simple" },
	["sp_dapple"] = { name = "Brûlé", desc = "Cette arme a été peinte à la bombe selon un motif de brûlures.\n\nLe phénix n'est pas un symbole de destruction... c'est un symbole de renaissance - Valeria Jenner, Révolutionnaire" },
	["sp_splash_p250"] = { name = "Splash", desc = "Cette arme a été peinte à la bombe en utilisant un pochoir en forme d'éclaboussures." },
	["hy_hunter_modern"] = { name = "Chasseur moderne", desc = "Cette arme a été personnalisée en utilisant un film hydrographique sur le thème de la chasse." },
	["hy_hunter_blaze_pink"] = { name = "Splash jam", desc = "hy_hunter_blaze_pink" },
	["hy_hunter_blaze_orange"] = { name = "Orange vif", desc = "hy_hunter_blaze_orange" },
	["sp_nukestripe_brown"] = { name = "Risque d'irradiation", desc = "sp_nukestripe_brown" },
	["sp_nukestripe_maroon"] = { name = "Retombée radioactive", desc = "sp_nukestripe_maroon" },
	["sp_nukestripe_orange"] = { name = "Danger radioactif", desc = "sp_nukestripe_orange" },
	["sp_nukestripe_green"] = { name = "Menace nucléaire", desc = "sp_nukestripe_green" },
	["sp_zebracam"] = { name = "Prédateur", desc = "Cette arme a été peinte à la bombe selon un motif zébré." },
	["sp_zebracam_bw"] = { name = "Zèbre pâle", desc = "sp_zebracam_bw" },
	["sp_zebracam_blue"] = { name = "Zèbre azur", desc = "sp_zebracam_blue" },
	["CSGO_Camo"] = { name = "Camouflage GO", desc = "Cette arme a été personnalisée en utilisant un film hydrographique aux motifs du camouflage de Global Offensive." },
	["CSGO_Icosahedron"] = { name = "Mémento", desc = "Cette arme a été personnalisée en utilisant un film hydrographique aux motifs géométriques." },
	["cu_fireserpent_ak47_bravo"] = { name = "Serpent de feu", desc = "Ce souvenir de Ruins a été peint d'après le motif d'un serpent de feu.\n\nSi vous voulez survivre dans la rue, apprenez à cracher du feu" },
	["cu_favela"] = { name = "Corticera", desc = "Cette arme a été personnalisée d'après le motif d'un arbre corticera." },
	["cu_dragon_p90_bravo"] = { name = "Dragon émeraude", desc = "Ce souvenir de Chinatown a été peint d'après le motif d'un dragon.\n\nLa tradition peut être dangereuse" },
	["hy_siege_bravo"] = { name = "Overgrowth", desc = "Ce souvenir de Siege a été personnalisé en utilisant un film hydrographique d'un camouflage.\n\nRegarde-moi dans les yeux et dis-moi que c'est de l'équipement standard - Felix Riley, Commandant" },
	["am_scales_bravo"] = { name = "Koï doré", desc = "Ce souvenir de Chinatown a été recouvert d'une feuille métallique avec un motif d'écailles.\n\nUne arme tapageuse dans tous les sens du terme" },
	["aq_etched_mac10_bravo"] = { name = "Graven", desc = "Ce souvenir de Gwalior possède des pièces gravées en laiton.\n\nIl brise deux commandements à la fois" },
	["cu_season_elites_bravo"] = { name = "Limba noir", desc = "Ce souvenir d'Agency possède une couleur en patine sombre et des crosses en limba noir.\n\nQuand la construction classique rencontre l'esthétique moderne" },
	["hy_seaside_bravo"] = { name = "Tempête", desc = "Ce souvenir d'Ali a été personnalisé en utilisant un film hydrographique d'une vague et d'un nuage.\n\nUne tempête approche" },
	["hy_crumple_dark_bravo"] = { name = "Facettes", desc = "hy_crumple_dark_bravo" },
	["hy_crumple_bravo"] = { name = "Désintégration", desc = "Ce souvenir d'Agency a été personnalisé en utilisant un film hydrographique aux motifs polygonaux.\n\nMes hommes sont des professionnels, ils feront bien le travail... - Elliott Kingsman, Criminel de carrière" },
	["hy_bluepolygon_bravo"] = { name = "Déméter", desc = "hy_bluepolygon_bravo" },
	["hy_ali_tile_bravo"] = { name = "Mosaico", desc = "hy_ali_tile_bravo" },
	["an_emerald_bravo"] = { name = "Emerald", desc = "Ce souvenir de Chinatown a été peint avec de la peinture transparente émeraude à effet anodisé sur la base d'une couche de chrome.\n\nC'est donc ce à quoi le grand Sebastien Hennequet a été réduit ? Un instit' hystérique ? Qu'est-ce qui t'es arrivé... - Le Professeur et l'Iconoclaste Partie 2" },
	["hy_mayan_dreams_bravo"] = { name = "Rêves mayas", desc = "Ce souvenir de Ruins a été personnalisé en utilisant un film hydrographique aux motifs de nuages maya.\n\nParfois, un sacrifice est nécessaire" },
	["am_ossify_blue"] = { name = "Écume océanique", desc = "Cette arme a été personnalisée en utilisant un film hydrographique bleu abstrait transparent sur la base d'une couche métallique." },
	["am_crumple"] = { name = "Graphite", desc = "Cette arme a été peinte avec des peintures métalliques réflectives selon un motif de polygones et sur la base d'une couche de chrome." },
	["sp_skull_diagram_bravo"] = { name = "Pile de crânes", desc = "Ce souvenir de Cache a été peint avec le motif de crânes sur un schéma de câblage.\n\nUne de plus pour la collection" },
	["sp_star_bravo"] = { name = "Zirka", desc = "Ce souvenir de Cache a été peint d'après le motif d'une étoile.\n\nImogen, comme son père, porte beaucoup d'importance sur la qualité, mais son ambition est encore plus féroce" },
	["aq_steel_bravo"] = { name = "Aspect rouillé", desc = "Ce souvenir de Siege est en parfait état de marche, bien qu'il a l'air rouillé.\n\nLes cicatrices forgent le caractère" },
	["cu_xray_m4"] = { name = "Rayon X", desc = "Cette arme a été peinte d’après le motif d'un Rayon X montrant les éléments internes de cette M4." },
	["cu_xray_p250"] = { name = "Rayons X", desc = "Un P250 personnalisé scanné aux rayons X." },
	["an_titanium30v"] = { name = "Bleu titane", desc = "Cette arme possède des pièces en titane dont la couleur bleue est caractéristique d'une couche d'oxyde réalisée par une anodisation contrôlée de 30 volts." },
