	["cu_pinstripe_ak47"] = { name = "Rayures émeraudes", desc = "Cette arme est faite de bois de chêne des marais et peinte de rayures blanches et vertes.\n\nInterroger Imogen, c'est m'interroger moi. Maintenant relax, bois un scotch et parlons business - Le Père et Le Phoenix Parie 2" },
