	["aq_obsidian"] = { name = "Magma", desc = "Cette arme possède des parties cuivrées qui ont été recouvertes d'un motif magma et patinées d'une couleur rouge en utilisant du chlorure de sodium et une forte chaleur. Les zones non-masquées ont ensuite été foncées par oxydation en utilisant du foie de soufre.\n\nUne cadence de tir enflammée" },
