	["am_metals"] = { name = "Chevalier", desc = "Cette arme a été incrustée de laiton d'après un thème d'armure de la Renaissance.\n\nComment ça vous ne trouvez pas Cocinero et Izaki ? - Felix Riley, Commandant" },
	["am_chainmail"] = { name = "Cotte de mailles", desc = "Cette arme a été peinte en utilisant un film hydrographique semi-transparent d'un motif de cotte de mailles sur la base d'une couche argentée.\n\nDe tous les membres de Phoenix, aucun n'est plus loyal à Valeria que sa garde du corps Naomi" },
	["aq_handcannon"] = { name = "Canon à main", desc = "Cette arme a été personnalisée avec des pièces en laiton qui ont été patinées à l'acide en s'inspirant des canons en laiton antiques.\n\nPrépare toi à rencontrer beaucoup d'épines lors des procès à venir" },
	["am_metal_inlay"] = { name = "Âge sombre", desc = "Cette arme a été peinte avec des peintures métalliques pour laisser paraitre qu'elle a été incrustée de pièces de métal aux motifs médiévaux.\n\nJe pourrai tuer son amant... ça nous fera peut être gagner du temps avec Valeria - L'amour d'un Père Partie 2" },
	["hy_vines"] = { name = "Églantier", desc = "Cette arme a été personnalisée en utilisant un film hydrographique de vignes courbées et de fleurs.\n\nUn vrai baiser d'amour ne peut vous sauver de ses épines" },
	["so_indigo"] = { name = "Bleu royal", desc = "Cette arme a été peinte selon un jeu de couleurs indigo, rouge cramoisi et gris.\n\nTu devrais sourire Felix, t'aurais plus de chance avec les femmes si t'avais pas l'air aussi austère à longueur de temps - Imogen, Trafiquante d'Armes en Formation" },
	["so_indigo_and_grey"] = { name = "Indigo", desc = "Cette arme a été peinte selon un jeu de couleurs indigo, bleu et gris.\n\nAlex Kincaide, je suis sûr que vous avez plein de questions... laissez-moi vous donner quelques réponses - Le Phoenix et Le Conteur Partie 1" },
	["cu_well_traveled_ak47"] = { name = "Jet set", desc = "Sa crosse a été recouverte par un cuir marron. Cette arme a visité de nombreuses villes.\n\nN'importe qui prêtant un peu attention sera capable de connecter les points et voir ce qu'elle a fait. On a pas beaucoup de temps pour trouver une solution... - L'amour d'un Père Partie 1" },
