	["cu_luggage_mac10"] = { name = "Transit", desc = "Cette arme a été personnalisée en utilisant un film hydrographique à carreaux et a été en partie recouverte par du faux cuir de crocodile.\n\nIls ont mordu à l'hameçon, on y va... - Elliott Kingsman, Mercenaire" },
	["cu_medieval_dragon_awp"] = { name = "Traditions des dragons", desc = "Cette arme a été personnalisée d'entrelacs formant un dragon.\n\nMême 200 clés ne suffiraient à percer ses secrets" },
	["cu_luggage_p2000"] = { name = "Classe économique", desc = "Cette arme a été personnalisée en utilisant un film hydrographique à carreaux et des parties de la crosse ont été recouvertes par du cuir marron.\n\nC'est pas très élégant, mais ça t'emmène où tu dois aller" },
	["aq_pilot_deagle"] = { name = "Aviateur", desc = "Cette arme a été incrustée de laiton d'après des ailes d'un aviateur.\n\nAdoptez la position de sécurité" },
	["cu_leather_xm1014"] = { name = "Cuir rouge", desc = "Sa crosse et sa garde avant ont été recouvertes par du cuir rouge.\n\nFaites vos valises. On va tuer ce fils de pute... - The Oni and The Valkyrie Part 2" },
	["cu_luggage_sg553"] = { name = "Voyageur", desc = "Cette arme a été personnalisée avec un motif à rayures inspiré de bagages vintages et possède quelques parties recouvertes par du cuir marron.\n\nTout le monde a une histoire et Javier vous l'arrachera de la bouche avant de vous tuer" },
	["cu_luggage_usp-s"] = { name = "Classe affaires", desc = "Cette arme a été personnalisée avec des couleurs et des motifs inspirés de bagages vintages et possède quelques parties recouvertes par du cuir marron.\n\nCertaines personnes ne veulent pas seulement un peut plus de place pour les jambes... ils veulent un peu de paix et de calme" },
	["hy_plaid1"] = { name = "Tissu olive", desc = "Cette arme a été personnalisée en utilisant un film hydrographique de motifs à carreaux beige et vert olive.\n\nJ'aime ça. Ça fait ressortir mes yeux sur la caméra... - Rona Sabri, Étoile Montante" },
