	["aq_glock_coiled"] = { name = "Broyeur", desc = "La glissière en acier a été personnalisée en utilisant une combinaison de pochoirs et de peintures à l'huile.\n\nLa seule manière de faire des diamants est d'appliquer de la pression" },
	["am_g3sg1_murky"] = { name = "Sombre", desc = "Cette arme a été anodisée puis peinte en utilisant un film hydrographique aux motifs de tâches de léopard.\n\nIl y a toujours un endroit plus sombre où aller" },
	["aq_m4a1s_basilisk"] = { name = "Basilic", desc = "Cette arme a été ornée d'un basilic.\n\nC'est malpoli de fixer, mais la guerre n'est pas le temps pour les civilités" },
	["cu_m4a4_griffin"] = { name = "Griffon", desc = "Cette arme a été personnalisée d'une illustration d'un griffon peint à la main.\n\nFelix a personnellement choisi son équipe à partir d'opérateurs partout dans le monde... Et si les gens s'interrogent sur leurs personnalités, ils ne remettent jamais en cause les résultats" },
	["sp_mag7_firebitten"] = { name = "Pyromane", desc = "Cette arme a été peinte de plusieurs couches de bombe puis délavées pour donner aux arrêtes de l'arme une apparence d'embrasement.\n\nCela commence toujours avec une petite étincelle" },
	["cu_mp9_chevron"] = { name = "Dard", desc = "Cette arme a été personnalisée en utilisant un film hydrographique aux motifs de rayures en chevron.\n\nMitraille autant que tu peux et tu devrais bien finir par avoir le centre de la cible" },
	["aq_p250_cartel"] = { name = "Cartel", desc = "Cette arme a été gravée de motifs de crânes squelettiques et de fleurs et possède une crosse personnalisée.\n\nUne petite pression transforme chaque matin en Jour du Mort" },
	["cu_p2000_fire_elemental"] = { name = "Élémentaire de feu", desc = "Cette arme a été personnalisée avec l'image d'une créature fait de feu.\n\nParfois, jouer avec le feu est une bonne chose" },
	["aq_sawedoff_blackgold"] = { name = "Brigand", desc = "Cette arme a été laquée en noir et or en utilisant un motif de chardon écossais.\n\nTu n'as pas besoin de sortir le petit doigt quand tu appuies sur la détente, mais c'est une touche d'élégance" },
	["cu_scar20_intervention"] = { name = "Cardiaque", desc = "Cette arme a été enveloppée par du vinyle pré-imprimé dans un orange moderne et un bleu design.\n\nBeep. Beep. Beeeeeeeeeeeep..." },
