	["cu_xm1014_caritas"] = { name = "Tranquillité", desc = "Cette arme a été peinte à la main d'après le motif d'une femme aux cheveux longs.\n\nJe ne suis pas ici pour ce dont j'ai besoin ; je suis ici pour quelque chose que je veux - Imogen et l'Oni Partie 2" },
	["am_awp_glory"] = { name = "Man-o'-war", desc = "Cette arme a été personnalisée par une une sous-couche d'une peinture bleu métallique, puis peinte à la main par des tourbillons et des accents d'une couleur métallique dorée.\n\nTourne quelques têtes avant de les enlever" },
	["cu_elites_urbanstorm"] = { name = "Choc urbain", desc = "Cette arme a été personnalisée d'un camouflage urbain et de touches bleutées.\n\nAvec la foudre vient toujours le tonnerre" },
