	["cu_galil_abrasion"] = { name = "Moulin à paroles", desc = "Cette arme a été peinte à la main puis usée. Le crâne peint sur la protection de la fenêtre d'éjection donne l'impression qu'il parle lorsque la culasse va et vient.\n\nCertains disent que lorsque tu ris, le monde rit avec toi... Mais quand Chatterbox rit il n'y a que des cris" },
	["cu_glock_deathtoll"] = { name = "Catacombes", desc = "Cette arme a été personnalisée en utilisant un film hydrographique de crânes sur une base de peinture en métal argenté.\n\nL'intimidation est la forme la plus sincère de la flatterie" },
