	["am_mac10_malachite"] = { name = "Malachite", desc = "Cette arme a été personnalisée en utilisant des peintures à effet métallique et d'un peigne en caoutchouc pour donner ce motif ondulé.\n\nDes couleurs vives cachent une arme avec de sombres intentions" },
	["cu_mp9_deadly_poison"] = { name = "Poison mortel", desc = "Cette arme a été personnalisée de formes angulaires et dynamiques d'une araignée stylisée.\n\nCe n'est pas la première morsure qui te tue, ce sont les 29 suivantes" },
