	["cu_sawedoff_deva"] = { name = "Sérénité", desc = "Cette arme a été peinte à la main d'après l'image d'une femme avec des ailes.\n\nLa sérénité est un luxe que peu peuvent se permettre - Valeria Jenner, Révolutionnaire" },
	["aq_scar20_leak"] = { name = "Grotte", desc = "Cette arme a été peinte au pinceau et tamponnée de peintures bleues à effet métallique.\n\nLe créateur de la Season Corporation a commandé cette pièce après avoir été secouru par le célèbre Opérateur Kotaro Izaki" },
	["aq_xm1014_sigla"] = { name = "Mercure", desc = "Cette arme a été personnalisée en utilisant un film hydrographique au motif d'une carte de relief appliquée sur une peinture métallique en argent.\n\nOn a parfois besoin d'un élément instable pour résoudre ses problèmes - Kotaro Izaki, Expert en Failles" },
	["an_tiger_orange"] = { name = "Dent de tigre", desc = "Cette arme a été anodisée en orange puis des rayures de tigre ont été peintes à la main.\n\nComme le tigre, il est rare... comme le tigre, il est mortel..." },
	["am_marble_fade"] = { name = "Marbre fondu", desc = "Cette arme a été personnalisée en utilisant des peintures métalliques noires et argentées pour obtenir des marbrures moyennes, puis elle a été revêtue de trois couleurs plus attrayantes.\n\nLa lame est composée de plusieurs couleurs, mais bientôt tout sera rouge" },
	["am_marbleized"] = { name = "Doppler", desc = "Cette arme a été personnalisée en utilisant des peintures métalliques noires et argentées pour obtenir des marbrures moyennes, puis elle a été revêtue de couleurs plus attrayantes.\n\nSe perdre dans sa couleur peut s'avérer mortel" },
	["cu_ak47_mastery"] = { name = "Elite Build", desc = "It has been custom painted using a combination of hydrographics and careful stenciling and detailed with heat-transfer decals.\n\nTread softly Naomi...people in your line of work aren't known for their longevity - The Shield and The Serpent Part 2" },
