	["aq_awp_twine"] = { name = "Dieu ver", desc = "Cette arme a été personnalisée avec l'image d'un crâne et de racines en utilisant de la peinture émaillée haute durabilité.\n\nCertaines racines ne sont pas bonnes à prendre" },
	["am_bronze_sparkle"] = { name = "Déco en bronze", desc = "Cette arme a été personnalisée avec un motif d'art décoratif en utilisant de la peinture métallique automobile.\n\nTout le monde cherche l'or et l'argent" },
	["aq_p250_contour"] = { name = "Valence", desc = "Cette arme a été personnalisée avec un design moderne bleu et gris qui vient complémenter la forme de l'arme.\n\nVos capacités ne sont pas en cause, votre attitude l'est - Le Professeur et L'Iconoclaste Partie 1" },
