	["cu_galil_eco"] = { name = "Éco", desc = "Cette arme a été personnalisée en utilisant de la peinture verte et blanche et détaillée avec des décalcomanies à transfert de chaleur.\n\nPour une somme suffisante, l'Unité d'Élite fera de n'importe quelle cause la sienne" },
	["aq_famas_jinn"] = { name = "Djinn", desc = "Cette arme a été personnalisée avec de l'or et du nickel incrusté et engravée de l'image d'un djinn.\n\nMéfiez-vous de vos aspirations" },
