	["so_khaki_green"] = { name = "Para vert", desc = "Des parties de cette arme ont été peintes selon un jeu de couleurs vert kaki et noir.\n\nQui il était ne change pas qui il est devenu. T'en fait pas Felix... Je vais l'arrêter - Le Paladin et Le Professeur Partie 2" },
	["cu_anime_aug"] = { name = "Akihabara Accept", desc = "Cette arme a été personnalisée avec des décalcomanies à transfert de chaleur en vinyle d'une couverture d'un magazine d'animé.\n\nYatta!" },
