	["hy_bamboo_jungle_black"] = { name = "Ombre de bambou", desc = "Cette arme a été personnalisée en utilisant un film hydrographique de bambou peint au pinceau.\n\nKotaro a perdu son fils avec cette arme... et un jour il l'utilisera pour arrêter l'homme responsable" },
	["hy_bamboo_jungle"] = { name = "Forêt de bambou", desc = "Cette arme a été personnalisée en utilisant un film hydrographique de bambou peint au pinceau.\n\nJe pense toujours qu'elle devrait avoir un panda - Booth, Trafiquant d'armes" },
