	["hy_geometric_steps_yellow"] = { name = "Terrasse", desc = "Cette arme a été personnalisée avec un film hydrographique dans un motif géométrique.\n\nTu fais trop confiance à Valeria... ça va te mener à la mort - Franz Kriegeld, Tacticien Phoenix" },
	["hy_kimono_diamonds"] = { name = "Kimono lumineux", desc = "Cette arme a été personnalisée avec un film hydrographique dans un motif géométrique.\n\nJe sais que je t'en demande beaucoup... Turner était comme ton fils - Le paladin et le professeur Partie 1" },
