	["hy_kimono_diamonds_red"] = { name = "Kimono pourpre", desc = "Cette arme a été personnalisée en utilisant un film hydrographique d'un motif géométrique.\n\nTurner, tous les hommes peuvent être brisés... il suffit de trouver le bon point de pression - Le Traître et Le Chercheur de Vérité Partie 2" },
