	["cu_galilar_particles"] = { name = "Fusée", desc = "Cette arme a été personnalisée d'un design graphique de bandes et de particules pixelisées.\n\nLe premier étage de la fusée Space X a réussi à atterrir pour la première fois le 22 décembre 2015" },
