	["cu_m4a4_evil_daimyo"] = { name = "Daimyo démoniaque", desc = "Cette arme a été personnalisée d'un design graphique en rouge et noir.\n\nCarmen. Je l'ai trouvé...- L'Oni and le Valkyrie Partie 1" },
