	["cu_ump45_uproar"] = { name = "Émeute", desc = "Cette arme a été personnalisée en utilisant une combinaison d'un film hydrographique et de décalcomanies à transfert de chaleur.\n\nSi vous ne vouliez pas de dommages collatéraux, peut-être aurait-il fallu le dire plus tôt... - Javier Alviso, Poing de The Phoenix" },
	["cu_usp_progressiv"] = { name = "Torque", desc = "Cette arme a été personnalisée avec un design moderne noir, blanc et jaune.\n\nIls te manipulent, Kotaro. Et si tu n'arrives pas à le voir, tu es beaucoup plus en danger que tu ne le penses... - Felix Riley, Commandant" },
	["cu_ak47_winter_sport"] = { name = "Sports d'hiver", desc = "Cette arme a été peinte avec des couleurs arctiques vibrantes.\n\nJ'aime travailler dans la neige... elle laisse toujours de magnifiques traces - Javier Alviso, Poing de The Phoenix" },
