	["gs_m4a1s_snakebite_gold"] = { name = "Serpentin doré", desc = "Cette arme a été personnalisée en utilisant un film hydrographique d'un serpent en train d'attaquer.\n\nLa vipère peut attaquer de n'importe où" },
	["cu_mac10_alekhya_duo"] = { name = "Rangeen", desc = "Cette arme a été personnalisée d'un motif de l'Égypte antique.\n\nPeux-tu résister à son regard plein de colère ?" },
	["cu_mag7_myrcene"] = { name = "Cœur cobalt", desc = "Cette arme a été personnalisée d'un design graphique futuriste.\n\nGardez-le en sécurité, Carmen - The Valkyrie and The Paramour Part 1" },
	["cu_mp7_classified"] = { name = "Livraison spéciale", desc = "Cette arme a été -CENSURÉ-\n\nSi je fais ce que tu veux, tu me laisseras partir ? - Le Phoenix et Le Conteur Partie 2" },
	["hy_p250_crackshot"] = { name = "Tir emplumé", desc = "Cette arme a été personnalisée en utilisant un film hydrographique dynamique.\n\nParfois, un subtil coup de coude est tout ce qu'il faut pour obtenir ce que tu veux - Franz Kriegeld, Tacticien Phoenix" },
	["gs_scar20_peacemaker03"] = { name = "Vert marine", desc = "Cette arme a reçu un motif camouflage avec une peinture métallique.\n\nÉcoutez tous... Izaki et Cocinero peuvent être absents mais notre mission reste la même : nous sauvons Alex Kincaide - Felix Riley, Commandant" },
	["cu_ssg08_technicality"] = { name = "Enclume", desc = "Cette arme a été personnalisée avec un filtre hydrographique jaune et orange puis légèrement patiné.\n\nUne victoire, même marquée d'un astérisque, reste une victoire - Rona Sabri, Étoile Montante" },
	["cu_usp_kill_confirmed"] = { name = "Victime confirmée", desc = "Cette arme a été personnalisée avec l'image d'une balle fracassant un crâne.\n\n2 dans la poitrine, 1 dans la tête" },
	["aq_xm1014_scumbria"] = { name = "Maquereau", desc = "Cette arme a été subtilement peinte avec des peintures métalliques.\n\nNe paniquons pas : il doit y avoir une autre façon d'attirer l'attention de Valeria... - L'amour d'un Père Partie 3" },
	["cu_ak47_point_disarray"] = { name = "Complexe géométrique", desc = "Cette arme a été personnalisée en utilisant un film hydrographique aux formes géométriques.\n\nDe près, c'est le chaos... de loin, c'est une beauté - Franz Kriegeld, Tacticien Phoenix" },
	["am_aug_jumble"] = { name = "Ricochet", desc = "Cette arme a été personnalisée avec un motif de deux tons d'entrelacs.\n\nKotaro n'a pas besoin de notre protection - The Valkyrie and The Paramour Partie 2" },
	["cu_bizon_noxious"] = { name = "Barre de combustible", desc = "Cette arme a été personnalisée pour donner l'illusion de munitions irradiées.\n\nQuelques fois, les troufions ont le dernier mot" },
	["aq_deagle_corinthian"] = { name = "Corinthian", desc = "Cette arme a été personnalisée au laser et possède une poignée personnalisée en cuir.\n\nProtection. Espoir. Confiance. Persévérance." },
	["cu_fiveseven_retrobution"] = { name = "Retrobution", desc = "Cette arme a été personnalisée à l'aide d'un film hydrographique rétro.\n\nCertains choses resteront toujours à la mode" },
	["cu_g3sg1_executioner"] = { name = "Bourreau", desc = "Cette arme a été peinte à la main d'après un motif osseux particulièrement repoussant.\n\nJ'emporte toujours un trophée - Javier Alviso, Poing de The Phoenix" },
	["gs_m4a4_royal_squire"] = { name = "Paladin royal", desc = "Cette arme a été méticuleusement peinte et gravée pour lui conférer un sentiment de grandeur.\n\nJe n'ai jamais reçu l'appel, tu entends ? - Le Paladin et le Père Partie 1" },
	["cu_negev_impact"] = { name = "Power Loader", desc = "Cette arme a été personnalisée en utilisant un film hydrographique évoquant la machinerie lourde.\n\nCraint des Reines. Adoré des Fous." },
	["am_p2000_imperial_red"] = { name = "Impérial", desc = "Cette arme a été gravée au laser et peinte avec des peintures métallisées rouge et jaune.\n\nCe que je ressens est sans importance Keo, j'ai un empire à protéger - Booth, Trafiquant d'armes" },
	["cu_p90_shapewood"] = { name = "Motif bois", desc = "La crosse en bois a été sculptée à la main, poncée et vernie.\n\nPinces non comprises" },
	["gs_sawedoff_necromancer"] = { name = "Yorick", desc = "Cette arme a été personnalisée d'un film hydrographique en forme de crâne et d'accents en or peints à la main.\n\nRosencrantz et Guildenstern n'avaient aucune chance..." },
	["hy_scar20_jungler"] = { name = "Épidémie", desc = "Cette arme a été personnalisée d'ombres vertes vives.\n\nValeria devient de plus en plus téméraire... il est temps de passer à l'attaque - Felix Riley, Commandant" },
	["gs_sg553_tiger_moth"] = { name = "Écaille martre", desc = "Cette arme a été personnalisée d'un motif d'écaille martre.\n\nValeria devient de plus en plus téméraire... il est temps de passer à l'attaque - Felix Riley, Commandant" },
	["cu_tec9_avalanche"] = { name = "Avalanche", desc = "Cette arme a été personnalisée avec un film hydrographique futuriste et épuré.\n\nNous devons bien réfléchir à notre façon de l'approcher, un seul faux pas et elle nous tombera dessus - Le serpent et le chercheur de vérité" },
	["aq_xm1014_hot_rod"] = { name = "Bec Teclu", desc = "Cette arme a été personnalisée de flammes réalisées à l'aide d'une peinture métallique.\n\nQuelques fois, un bunsen n'est pas suffisant..." },
	["gs_ak47_supercharged"] = { name = "Circuit d'injection", desc = "Cette arme a été personnalisée d'une peinture jaune brillante et le chargeur a été peint de manière à ressembler à une machinerie.\n\nVivez votre vie un quart de munitions à la fois" },
	["cu_bizon_citizen"] = { name = "Zone photique", desc = "Cette arme a été personnalisée d'un motif camouflage et accentuée d'une peinture fluorescente.\n\nCe ne sont pas les vagues que vous entendez..." },
	["aq_deserteagle_kumichodragon"] = { name = "Dragon Kumicho", desc = "Des dragons ont été gravés au laser sur le chargeur et la crosse.\n\nJe suis un grand admirateur de votre travail, Yukako. Nous devrions discuter... - Huxley, La compétition" },
	["cu_fiveseven_augmented"] = { name = "Triumvirat", desc = "Cette arme a été personnalisée d'un film hydrographique numérique et le chargeur a été personnalisé d'une fine couche de peinture.\n\nJe ne profite pas de la guerre, je profite des conditions humaines... - Booth, Trafiquant d'armes" },
	["gs_glock18_award"] = { name = "Légion royale", desc = "Cette arme a été méticuleusement gravée.\n\nNaomi comprendra qu'un jour, elle mourra pour Valeria" },
	["gs_m4a4_pioneer"] = { name = "Pionnier", desc = "Cette arme a été personnalisée à l'aide d'un film hydrographique futuriste rappelant les vaisseaux spatiaux.\n\nAnecdote : l'Europe lança pour la première fois son vaisseau spatial, l'IXV, le 11 février 2015" },
	["am_mac10_electricity"] = { name = "Lapis-gator", desc = "Cette arme a été personnalisée d'un film hydrographique en peau d'alligator.\n\nHydroglisseur non-inclus" },
	["gs_mag7_praetorian"] = { name = "Prétorien", desc = "Cette arme a été distinctement personnalisée de peintures métallisées.\n\nLa boucle se boucle" },
	["sp_mp7_impire"] = { name = "Impire", desc = "Cette arme a été personnalisée d'un film hydrographique avec des diablotins.\n\nL'extermination n'a jamais été aussi adorable" },
	["cu_ssg08_necropos"] = { name = "Necropos", desc = "Cette arme a été peinte à la main d'après le motif de runes abominables.\n\nTous les charpentiers ont besoin de leur marteau, les tailleurs de leur fuseau..." },
	["gs_tec9_jambiya"] = { name = "Jambiya", desc = "Cette arme a été peinte à la main et gravée au laser avec des motifs du Moyen-Orient.\n\nShahrazad a raconté 1000 histoires... celle-ci sera la dernière que tu entendras" },
	["gs_usp_voltage"] = { name = "Tension", desc = "Le chargeur et le silencieux de cette arme ont été personnalisés et gravés.\n\nTu as eu ce que tu voulais, tu sais ce que ça veut dire maintenant ? – Booth, Trafiquant d'armes" },
	["cu_aug_swallows"] = { name = "Hirondelles", desc = "Cette arme a été personnalisée en utilisant un film hydrographique d'oiseaux volant à travers les nuages.\n\nCertains oiseaux représentent l'harmonie et la paix... ce ne sont pas ces oiseaux" },
	["cu_bizon_Curse"] = { name = "Jugement d'Anubis", desc = "Cette arme a été personnalisée d'un thème égyptien.\n\nSa gâchette est plus légère qu'une plume" },
	["gs_cz75a_redastor"] = { name = "Astor rouge", desc = "Cette arme a été personnalisée d'accents rouges et blancs peints à la main.\n\nBooth est devenu synonyme de scandale familial ; et qui a du temps pour les scandales lorsque l'on parle de business ? Huxley, La compétition" },
	["gs_dualberettas_ventilators"] = { name = "Conduits", desc = "Ces pistolets ont été élégamment peints à l'aide de chrome.\n\nUne arme pour les artistes, créés par les artistes" },
	["sp_g3sg1_militiaorange"] = { name = "Impact orangé", desc = "Une peinture orange à la bombe et des pochoirs donnent à ce fusil un style unique et distinctif.\n\nDevenez un Shere Khan moderne" },
	["gs_galilar_incenerator"] = { name = "Coups de feu", desc = "Cette arme a été personnalisée d'accents cramoisis et d'une icône peinte à la main.\n\nBooth a commandé cette arme à Valeria dans l'espoir d'arranger les choses avec The Phoenix" },
	["cu_m249_spectre"] = { name = "Spectre", desc = "Cette arme a été personnalisée d'une manière épurée et contemporaine.\n\nLa guerre civile de The Phoenix est sur le point de démarrer" },
	["cu_m4a1s_soultaker"] = { name = "Flammes de Chantico", desc = "Cette arme a été peinte à la main à l'aide de couleurs vibrantes et accentuées par une émoticône peinte sur sa crosse.\n\nProtégez ce qui vous appartient" },
	["am_mp9_bioleak"] = { name = "Fuite biologique", desc = "Différents tons de vert créent l'illusion d'un déversement de produits chimiques.\n\nÉVITEZ UNE EXPOSITION DIRECTE" },
	["hy_p2000_oceani"] = { name = "Océanique", desc = "Cette arme a été personnalisée d'une sous-couche noire et accentuée de touches de bleu.\n\nPersonne n'a entendu parler de Kotaro ou de Carmen ? - Felix Riley, Commandant" },
	["cu_p250_asiimov"] = { name = "Asiimov", desc = "Cette arme a été personnalisée d'un design de science-fiction.\n\nSi vous pensez que j'ai besoin d'un fusil pour tuer quelqu'un, vous ne savez vraiment pas à qui vous parlez... - Mikha Biton, Sniper de The Phoenix" },
	["gs_sawedoff_fubar"] = { name = "Fubar", desc = "Ce fusil à pompe, ayant tellement voyagé, possède une étoile sculptée sur son canon.\n\nÇa commence avec une détonation... Ça finit avec un long moment de silence" },
	["cu_sg553_atlas"] = { name = "Atlas", desc = "Cette arme a été personnalisée en utilisant un film hydrographique d'un camouflage moderne.\n\nCe design était autrefois assigné à la Coalition Taskforce, mais Huxley a espionné leur industrie pour le rendre exclusif à The Phoenix" },
	["gs_ssg08_armacore"] = { name = "Chasseur de fantômes", desc = "Cette arme a été personnalisée d'une peinture blanche et d'accents bleus arctiques.\n\nJe ne pourrai jamais remplacer ce qu'ils nous ont pris... mais je ne peux pas prendre plus que ce qu'ils ne possèdent déjà - The Phoenix et l'initié, partie 2" },
	["am_tec9_redblast"] = { name = "Retour de flamme", desc = "Le canon de cette arme a été personnalisé de décalcomanies de flammes.\n\nJe déteste avoir toujours raison - Carmen Cocinero, Experte en Extraction" },
	["cu_ump45_primalsaber"] = { name = "Sabre primitif", desc = "Cette arme a été personnalisée à l'aide d'un décalque d'un crâne de tigre à dents de sabre.\n\nChaque prédateur arrivera à sa fin à un moment ou à un autre" },
	["cu_xm1014_spectrum"] = { name = "Smoking", desc = "Cette arme a été personnalisée et peinte de chrome blanc et noir. Il est recommandé d'utiliser ce fusil à pompe pour les grandes occasions.\n\nNous avons Izaki et Cocinero. Vous en avez besoin, ou je peux les tuer dès maintenant ? - Le mercenaire et le serpent, partie 1" },
	["am_marbleized_g"] = { name = "Doppler Gamma", desc = "Cette arme a été personnalisée en utilisant des peintures métalliques noires et argentées pour obtenir des marbrures moyennes, puis a été revêtue de couleurs plus attrayantes." },
	["gs_autotronic"] = { name = "Autotronic", desc = "Cette arme a été anodisée en noir et utilise un filet d'acier pour réduire son poids." },
	["am_marked_up"] = { name = "Signature", desc = "Cette arme a été peinte en noir et en violet puis personnalisée avec un feutre indélébile." },
	["gs_aug_aristocrat"] = { name = "Cour royale", desc = "Cette arme a été personnalisée de filigrane argenté appliqué sur la base d'une couche bleu claire anodisée.\n\nPour les 1 %" },
	["gs_awp_phobos"] = { name = "Phobos", desc = "Cette arme a été construite à partir de métaux et de composants électroniques récents.\n\nBâtissez un monde meilleur" },
