	["cu_glock_wasteland_rebel"] = { name = "Rebelle des terres désolées", desc = "Cette arme a été usée et gravée de motifs, et recouverte de graffitis.\n\nTirez-leur un grand coup de chapeau" },
	["gs_m4a1_mecha_industries"] = { name = "Robot industriel", desc = "Cette arme a été personnalisée de lambris de céramique.\n\nUne technologie de pointe à votre service" },
