	["aq_mac_10_alien_camo"] = { name = "Carnivore", desc = "Cette arme a été personnalisée en utilisant un film hydrographique rouge et violet sur la base d'une couche métallique.\n\nPréparez avant de servir" },
	["aq_nova_sci_fi"] = { name = "Exo", desc = "Cette arme a été personnalisée en utilisant un film hydrographique argenté sur la base d'un motif violet.\n\nC'est l'intérieur qui compte" },
