	["gs_scar20_bloodsport"] = { name = "Combat sanglant", desc = "Cette arme a été recouverte avec des motifs blancs sur la base d'une couche hydrographique rouge et noire.\n\nAntiterroristes sponsorisés par…" },
	["cu_sg553_aerial"] = { name = "Aéro", desc = "Cette arme a été personnalisée de couches jaunes et argentées ainsi que d'un autocollant d'une aile blanche.\n\nInstaurez la supériorité aérienne" },
	["am_tec_9_sea_salt"] = { name = "Glacier", desc = "Cette arme a été personnalisée en utilisant un film hydrographique bleu et blanc abstrait.\n\nCoulez les forces ennemies" },
	["bloodhound_black_silver"] = { name = "Calcination", desc = "Ces gants ont été fabriqués à l'aide de cuir noir classique.\n\nLes insignes d'opérations, c'est cool, mais ça fait pas des blessures assez profondes - Carmen Cocinero, expert en extraction" },
	["bloodhound_snakeskin_brass"] = { name = "Morsure de serpent", desc = "Le cuir de ces gants a été mélangé à de la peau de serpent.\n\nSoyons honnête... Personne ne regrette Sergei - Hans Kriegeld, tacticien Phoenix" },
