	["bloodhound_guerrilla"] = { name = "Guérilla", desc = "Ces gants sont faits de cuir marron et de cuir synthétique au motif camouflage.\n\nValeria va les faire payer chèrement, cela ne fait aucun doute... - Sebastien Hennequet, Sniper" },
