	["handwrap_camo_grey"] = { name = "Bois numérique", desc = "Un motif de camouflage numérique gris est imprimé sur le tissu extérieur de ces gants.\n\nCertaines personnes se disent dures à cuire... d'autres le montrent" },
	["handwrap_red_slaughter"] = { name = "Carnage", desc = "Ces bandages de couleur pourpre rendent difficile à différencier le tissu des tâches de sang.\n\nQui n'aime pas travailler avec ses mains ?" },
	["handwrap_fabric_orange_camo"] = { name = "Badlands", desc = "Ces gants de bricolage sont faits à partir de matériaux de récupération.\n\nFelix n’en n’a que faire des règles de la fédération de boxe" },
	["slick_black"] = { name = "Tissage lunaire", desc = "Du daim bleu minuit a été entrelacé avec du cuir noir de jais pour donner à ces gants une apparence intemporelle.\n\nLa classe, la vraie... " },
	["slick_military"] = { name = "Convoi", desc = "Ces gants ont été créés à l'aide de cuir souple marron et de daim teinté.\n\nParfois, la discrétion s'impose" },
	["slick_red"] = { name = "Tissage pourpre", desc = "Du daim noir a été entrelacé avec du cuir écarlate pour donner à ces gants une apparence intemporelle.\n\nLaissez votre marque, mais pas celles de vos empreintes" },
	["slick_snakeskin_yellow"] = { name = "Diamantin", desc = "Ces gants sont un mélange de cuir brun, de cuir noir et de peau de serpent.\n\nLes versions réglementaires, c'est pour les crétins - Imogen, trafiquante d'armes en formation" },
	["sporty_green"] = { name = "Labyrinthe de haies", desc = "Ces gants verts et blancs ont été fabriqués par Icarus Athletics.\n\nSeuls les lâches ont peur de voler près du soleil" },
	["sporty_purple"] = { name = "Boîte de Pandore", desc = "Un motif subtil a été imprimé sur la paume de ces gants noirs et violets.\n\nUn must-have pour tout expert en démolition transpirant des mains" },
