	["sporty_military"] = { name = "Aride", desc = "Plusieurs nuances de marron et un motif de camouflage subtil donnent à ces gants une apparence honorable.\n\nSi nous voulons devenir des héros, nous devrions peut-être s'inspirer de leur look... - Rona Sabri, étoile montante" },
	["specialist_ddpat_green_camo"] = { name = "Tempéré numérique", desc = "Ces gants robustes cousus à la main associent cuir et camouflages numériques.\n\nCertaines personnes n'aiment pas salir leurs mains" },
	["specialist_kimono_diamonds_red"] = { name = "Kimono pourpre", desc = "Cette paire de gants noirs a été accentuée à l'aide d'un motif de diamants rouges.\n\nCommencez à voir rouge" },
	["specialist_emerald_web"] = { name = "Toile émeraude", desc = "L'arrière de ces gants a été personnalisé d'un motif de toile d'araignée.\n\nLa discipline engendre le succès" },
	["specialist_white_orange_grey"] = { name = "Fondation", desc = "Ces gants blancs et noirs ont été personnalisés d'accents oranges\n\nLa rumeur dit que Tortue a été inspirée par la gamme d'armes à feu Asiimov" },
	["motorcycle_basic_black"] = { name = "Éclipse", desc = "Ces gants ont été personnalisés du design noir classique ayant fait connaître Tortue.\n\nNe me dites pas que ça vient de la crise de la quarantaine" },
	["motorcycle_mono_boom"] = { name = "Boum !", desc = "Cette paire a été personnalisée d'onomatopées de bande dessinées.\n\nPOW ! BOUM ! BIFF !" },
	["motorcycle_mint_triangle"] = { name = "Menthe verte", desc = "Le cuir blanc et la couture rouge utilisés lors de la conception de ces gants les rendent aussi élégants que confortables.\n\nPour ce qu'il nous coûte, Huxley pourrait au moins nous donner des boîtes de pastilles à la menthe... - Felix Riley, commandant" },
	["motorcycle_triangle_blue"] = { name = "Menthe fraîche", desc = "Le cuir bleu utilisé lors de la conception de ces gants a été accentué de formes géométriques aux couleurs de l’arctique.\n\nLes combats n'ont été aussi rafraîchissants" },
