	["gs_mac10_fish_bait"] = { name = "Corégone", desc = "Des écailles de poisson, des os et des crochets ont été peints à la main par-dessus une couche noire.n\nFrais comme un gardon" },
	["gs_deagle_exo"] = { name = "Métro léger", desc = "Le motif appliqué à cette arme crée une illusion d'optique qui paraît changer ses dimensions.\n\nAlimentation électrique requise vendue séparément" },
