	["cu_revolver_oppressor"] = { name = "Briseur de crânes", desc = "Cette arme a été peinte à la main d'un motif de flammes jaunes ainsi que d'accents rouge et blanc.\n\n« Ouvrez graaaaand »" },
	["gs_m4a4_emperor"] = { name = "L'empereur", desc = "L'apparence de cette arme est inspirée de la carte de tarot de l'Empereur.\n\nÉcoutez votre tête, au détriment de votre cœur" },
	["cu_aug_momentum"] = { name = "Momentum", desc = "Cette arme a été personnalisée avec des peintures de couleurs vives et des flèches pointées vers l'avant.\n\nToujours aller de l'avant" },
	["gs_mp5sd_astromatic"] = { name = "Gauss", desc = "Cette arme a été personnalisée pour ressembler à un assemblage de morceaux d'acier estampé.\n\nAussi connu sous le nom de « SpaceGat 2000 »" },
	["cu_mp7_racketeer"] = { name = "Malice", desc = "Un sourire inquiétant noir et blanc a été peint par-dessus une couche rouge.\n\nIl ne prépare rien de bon" },
	["aq_p250_verdigris"] = { name = "Vert-de-gris", desc = "La base en cuivre de cette arme a été exposée aux intempéries, ce qui a formé ces gouttes vertes.\n\nÇa vient de l'air que tu respires" },
	["cu_p90_offworld"] = { name = "Voyage interstellaire", desc = "Plusieurs couches de peinture bleue ont été appliquées, bien plus que la dernière fois.\n\nCette couche ne séchera jamais…" },
	["cu_xm1014_incinerator"] = { name = "Incinégator", desc = "Un motif personnalisé qui ressemble à un alligator qui crache du feu a été appliqué.\n\nBoom. Bam. Bop... Pow." },
	["aa_ump45_moonrise_sunset"] = { name = "Lever de lune", desc = "Un paysage urbain au premier plan fait place à une pleine lune et à un ciel étoilé violet et rouge.\n\nFixez votre regard sur l'étoile du Nord" },
	["cu_bizon_road_warrior"] = { name = "Embargo", desc = "Rassemblée à partir d'objets trouvés, cette arme a une base bleu sarcelle et diverses publicités diffusées à La Havane dans les années 1950.\n\n¡Chao pescao!" },
	["gs_ak47_nibbler"] = { name = "Rat rod", desc = "La couche de finition bleue d'origine de cette arme récupérée à la casse a été repeinte plusieurs fois, usée et effacée par les intempéries.\n\nIl n'y a pas d'issue" },
	["cu_aug_whitefang"] = { name = "Loup arctique", desc = "Cette arme a été peinte de façon à ressembler au manteau blanc d'un loup arctique.\n\nChaque manche est un contre cinq" },
	["cu_awp_virus"] = { name = "Brèche de confinement", desc = "Cette arme a été peinte de façon à représenter des rats mutants qui essayent de s'échapper d'une forêt vert fluo radioactive.\n\nTu ne sais pas s'ils ont des maladies radioactives !" },
	["gs_mp5_etch"] = { name = "Lavage à l'acide", desc = "Avant que cette arme ne soit assemblée, sa couche bleue de base a été exposée à de l'acide. Elle a été personnalisée de ferrures en laiton.\n\nDu noir, du bleu et du laiton partout" },
	["gs_tec9_decimator"] = { name = "Massacreur", desc = "Des rehauts bleus et roses fluorescents sont peints sur cette arme.\n\nPayez 4 fois 124,95 USD seulement !" },
	["cu_nova_featherswing"] = { name = "Plume", desc = "Des plumes marron ont été peintes sur la culasse et la crosse en bois de cette arme.\n\nOn va essayer de ne pas y laisser des plumes" },
	["cu_g3sg1_blacksand"] = { name = "Sable noir", desc = "Un motif de camouflage sombre a été appliqué à cette arme.\n\nLa Coalition Taskforce était en train de gagner ; c'est pour ça que Mikah s'est résolu à adopter une approche un peu plus... agressive." },
	["gs_r8_memento"] = { name = "Souvenir", desc = "Le luxe de la crosse de cette arme se marie bien avec les métaux subtils utilisés pour la culasse, le canon et le barillet.\n\nAllez, hue !" },
	["cu_mp7_replica"] = { name = "Surcouche néon", desc = "Un effet de bois stratifié et toutes les couleurs néon imaginables ont été appliqués sur cette arme. \n\n« Roy G. Biv ? Jamais entendu parler »" },
	["cu_p2000_obsidian"] = { name = "Obsidienne", desc = "Cette arme a été peinte de façon à donner l'impression qu'elle a été plongée dans la lave puis qu'elle s'est solidifiée en obsidienne en refroidissant.\n\nLe terme « canon de verre » prend un tout autre sens" },
	["gs_dual_elites_rose"] = { name = "Équilibre", desc = "Une rose rouge a été peinte à la main sur l'une des poignées par-dessus une couche noire et un filigrane en argent.\n\nAu centre de tout" },
	["sp_scar20_striker_dust"] = { name = "Rayures", desc = "Des rayures ont été peintes à la main aléatoirement à la bombe.\n\nEn lambeaux..." },
	["cu_sg553_reactor"] = { name = "Colonie IV", desc = "Une fourmi rouge squelettique a été peinte à la main par-dessus un dessin de masques à gaz et de feu.\n\nRejoignez leur monde" },
	["gs_mac10_stalker"] = { name = "Fauve", desc = "Des rayures jaunes et noires ainsi qu'un chat bleu néon ont été peints pour personnaliser cette arme.\n\nViens-là, minou, minou..." },
	["cu_ssg08_tickler"] = { name = "Hyperémie oculaire", desc = "Une monstruosité avec des tentacules verts, une pléthore de dents et des globes oculaires ont été peints sur cette arme.\n\n« C'est pour mieux te voir, mon enfant »" },
	["gs_m249_warbird_veteran"] = { name = "Vieux coucou", desc = "Maintenant usée par le temps, cette arme était auparavant bleue avec un bouclier thermique jaune.\n\nCe vieux coucou a bien besoin d'un peu de repos" },
	["aq_m249_aztec"] = { name = "Aztèque", desc = "Découvertes et extraites des ruines aztèques, certaines parties de cette M249 ont rouillé et ont été recouvertes de mousse.\n\nNe jamais faire confiance à un pont suspendu" },
	["gs_dual_elites_classic"] = { name = "Élite 1.6", desc = "La culasse de ces Dual Berettas a été estampillée du mot « ÉLITE ».\n\nMatériel source" },
	["cu_famas_nuke_tension"] = { name = "Démantèlement", desc = "Le motif sur cette arme est inspiré des éléments trouvés sur de_nuke sur Counter-Strike 1.6.\n\nEn cas de perte, merci de contacter le centre nucléaire de Cedar Creek" },
	["cu_tec9_flash"] = { name = "GSS", desc = "Le motif appliqué à cette arme ressemble à une GSS.\n\nRe : cours de danse avec Jordan" },
	["cu_fiveseven_gsg9"] = { name = "Coéquipier", desc = "Cette arme a été personnalisée avec des motifs de camouflage et le visage d'un antiterroriste derrière le cran de mire.\n\nJe couvre tes arrières" },
	["gs_p250_inferno"] = { name = "Inferno", desc = "Le motif appliqué à cette arme fait référence à l'environnement de de_inferno.\n\n« But look at the time! » (Mais regarde le temps !)" },
	["gs_mac10_dust_crate"] = { name = "Caisse classique", desc = "Cette arme a été peinte de façon à rappeler les caisses en métal vertes qu'on trouvait sur de_dust2.\n\nRush B, on fonce" },
	["gs_mag7_popdog"] = { name = "Pop Dog", desc = "Le motif sur cette arme ressemble à un wagon avec le graffiti de Pop Dog.\n\n« The dog that refreshes! » (Le chien qui rafraîchit !)" },
	["cu_mp9_hydra"] = { name = "Hydra", desc = "Le motif sur cette arme fait référence à l'Operation Hydra, la huitième opération de CS:GO.\n\nÇa en valait la peine" },
	["cu_p90_nostalgia"] = { name = "Nostalgie", desc = "Cette arme a été personnalisée d'un antiterroriste du menu principal du premier Counter-Strike.\n\nQuelques minutes pour l'installer, mais une toute une vie pourle maîtriser" },
	["am_aug_death_by_doggy"] = { name = "Death by Puppy", desc = "Cette arme a été personnalisée d'un motif de Pop Dog multicolore.\n\nNombreux sont ceux qui le surnomment encore « ladder »" },
	["cu_scar_assault"] = { name = "Assault", desc = "Le logo d'un centre de recherche a été peint en blanc par-dessus une couche bleue.\n\nAussi disponible en rouge" },
	["gs_mp5_fbi"] = { name = "Agent", desc = "Cette arme a été peinte aux couleurs du FBI, puis a été accentuée de jaune.\n\n« It's time to earn our stories » (Il est temps d'écrire l'histoire)" },
	["cu_ump_bomb"] = { name = "Plastique", desc = "Cette arme a été personnalisée de motifs de fils électriques, d'un circuit imprimé vert et d'un pavé numérique.\n\n73556**" },
	["cu_awp_wildfire"] = { name = "Wildfire", desc = "Le logo de l'Opération Wildfire a été peint par-dessus une couche noire et rouge.\n\nLe clou qui dépasse appelle le marteau" },
	["cu_glock_hero"] = { name = "Sacrifice", desc = "Le motif appliqué à cette arme rend hommage au désamorçage brûlant d'olofmeister sur Overpass lors de l'ESL One Cologne 2014.\n\n« The defuse is coming in -- he's still going! » (La bombe est en train d'être désamorcée... Il continue !)" },
	["gs_famas_legacy_gold"] = { name = "Commémoration", desc = "Cette arme a été peinte en or et décorée de nombreux détails en l'honneur du 20e anniversaire de Counter-Strike.\n\nC'est reparti pour 20 ans" },
	["gs_ak47_gold_arabesque"] = { name = "Arabesque dorée", desc = "Un motif élaboré a été peint à la main sur la crosse et le garde-main de cette arme. Le métal a été peint en or et agrémenté de finitions en filigrane.\n\n« Qu'est-ce que Booth manigance encore ? »" },
	["am_lizard_red"] = { name = "Anolis orange", desc = "Un motif d'écailles de lézard or et rouge a été appliqué à cette arme.\n\nCuirasse à écailles" },
	["hy_brush_camo_tan"] = { name = "Teinte désertique", desc = "Un motif de couleur sable a été peint sur cette arme par hydrographie.\n\nMise à l'épreuve de l'efficacité du camouflage nº 1" },
	["hy_ddpat_urban_red"] = { name = "Rouge numérique", desc = "Cette arme a été personnalisée en utilisant un film hydrographique d'un camouflage rouge numérique.\n\nSi tu es assez proche pour remarquer les pixels, il déjà trop tard." },
	["hy_dry_wood"] = { name = "Bois échauffé", desc = "Un motif à l'aspect de bois séché a été peint par hydrographie sur cette arme.\n\nTouche du bois, car t'auras besoin de beaucoup de chance. (Felix Riley, commandant)" },
	["hy_desert_multicam"] = { name = "Noir et beige", desc = "Cette arme a été personnalisée en utilisant un film hydrographique MultiCam noir et ambré.\n\nPas de tir, pas de cible." },
	["hy_torn_camo_paints"] = { name = "Sables mouvants", desc = "La crosse et la culasse de cette arme ont été personnalisées avec un motif hydrographique beige et bleu. Le canon a été peint en bleu marine.\n\n« Ravissant » serait un euphémisme." },
	["sp_moro_carving_lightblue"] = { name = "Nouvelles racines", desc = "Une plante grimpante et un motif floral ont été peints à la bombe dans différentes nuances de vert.\n\nSilence, ça pousse." },
	["sp_moro_carving_yellow"] = { name = "Vieilles racines", desc = "Une plante grimpante et un motif floral ont été peints à la bombe dans différentes nuances de vert.\n\nAntique, fané, délavé… en un mot, « vieux »." },
	["sp_moro_textile_purple_yellow"] = { name = "Vigne flétrie", desc = "Un motif floral violet et doré a été peint à la bombe sur cette arme.\n\nCertaines personnes y voient un désagrément ; moi, j'y vois de la beauté." },
	["sp_palm_night"] = { name = "Palmier de minuit", desc = "Des feuilles de palmier ont été peintes à la bombe sur un camouflage gris et violet.\n\nL’écriteau dit : « Fermé » !" },
	["sp_desert_skulls"] = { name = "Décoloré", desc = "Un motif de crânes d'animaux a été peint à la bombe sur cette arme.\n\nIl ne reste qu'un tas d'os." },
