	["cu_ssg08_scorpion"] = { name = "Piqure mortelle", desc = "Un scorpion empereur se faisant engloutir par le sable a été peint sur ce SSG 08.\n\nÇa va piquer…" },
	["hy_desert_bloom"] = { name = "Aridité", desc = "Des fleurs aux couleurs vives, plantées dans de la terre sèche et craquelée, ont été peintes à la bombe sur cette arme.\n\nLa nature gagne toujours." },
	["am_ddpat_purple"] = { name = "Pourpre numérique", desc = "Cette arme a été personnalisée en utilisant un film hydrographique d'un camouflage violet numérique.\n\nSi tu es assez proche pour remarquer les pixels, il déjà trop tard." },
	["gs_awp_hydra"] = { name = "Hydra du désert", desc = "Des serpents dorés rampent vers le canon de cet AWP personnalisé. Sa lunette, son canon et l'arrière de sa crosse ont été peints en blanc.\n\nSi tu coupes une tête, deux autres apparaitront. Tu veux vraiment prendre ce risque ? (Valeria Jenner, révolutionnaire)" },
	["gs_deagle_fennec"] = { name = "Fennec", desc = "Un fennec a été peint sur le canon de cette arme. Sa crosse présente des motifs bleu sarcelle et orange.\n\nC'est pour mieux t'entendre, mon enfant." },
	["am_mirage_flowers_metalic"] = { name = "Boite à musique", desc = "Un motif de damas doré a été appliqué à cette arme.\n\nGuerre folle." },
	["am_moro_textile_bright"] = { name = "Vignes élégantes", desc = "Un motif floral rouge et vert a été appliqué à cette arme.\n\nCertaines personnes y voient un désagrément ; moi, j'y vois de la beauté" },
	["am_navy_shine"] = { name = "Éclat marin", desc = "Un motif bleu marine VariCamo anodisé a été appliqué.\n\n Pourquoi est-ce si bleu ? " },
	["gs_aug_sand_storm"] = { name = "Tempête de sable", desc = "Un motif représentant une tempête de sable sous un ciel étoilé a été peint sur cette arme.\n\nLa beauté est partout, il suffit de savoir où regarder." },
	["sp_dry_wood"] = { name = "Bois de grève", desc = "Un motif à l'aspect de bois séché a été peint sur cette arme en utilisant une bombe couleur marron.\n\nTouche du bois, car t'auras besoin de beaucoup de chance. (Felix Riley, commandant)" },
	["sp_desert_skulls_dawn"] = { name = "Sècheresse", desc = "Un motif de crânes d'animaux a été peint à la bombe sur cette arme.\n\nIl ne reste qu'un tas d'os." },
	["sp_mirage_flowers_tan"] = { name = "Damas terre de Sienne", desc = "Des roses de Damas ont été peintes à la bombe par-dessus la couche primaire beige de l'arme.\n\nPar définition, les meilleurs camouflages sont ceux qu'on ne remarque pas…" },
	["sp_moro_carving_burnt"] = { name = "Cave à cigares", desc = "Un motif marron et violet de fleurs et de vignes a été peint à la bombe sur cette arme.\n\n« Qu'est-ce qu'il y a là-dedans ? »" },
	["sp_moro_textile_green_vine"] = { name = "Luxuriance", desc = "Un motif floral a été peint à la bombe dans différentes nuances de vert.\n\nCertaines personnes y voient un désagrément ; moi, j'y vois de la beauté." },
	["gs_mp5_neon_flektarn"] = { name = "Oasis oxydée", desc = "Un motif de camouflage turquoise et orange a été appliqué à cette arme. Elle a été agrémentée de finitions dorées.\n\nUne arme si silencieuse ne devrait pas être aussi tape-à-l'œil." },
	["aa_desert_bloom_bright"] = { name = "Floraison aride", desc = "Des fleurs aux couleurs vives, plantées dans de la terre sèche et craquelée, ont été peintes à la bombe sur cette arme.\n\nLa nature gagne toujours." },
	["hy_lizard_skin"] = { name = "Anolis", desc = "Un motif d'écailles de lézard vert et noir a été peint sur cette arme par hydrographie.\n\nCuirasse à écailles." },
	["cu_ak-47_phantom_disruptor"] = { name = "Créature fantasmagorique", desc = "Une créature chimérique chargée de brume a été peinte par-dessus une couche noir mat.\n\n« Elle peut devenir n'importe quoi, n'importe quand, et pourtant... Elle a choisi de cohabiter en vous. »" },
	["gs_aug_thunderstorm"] = { name = "Tom le chat", desc = "La sous-couche en fibre de carbone de cette arme a été mise en valeur avec des reflets dorés, des flèches orientées vers l'arrière et la tête d'un chat aux airs espiègles.\n\nLes orages sont le ronronnement de la nature" },
	["cu_awp_vein"] = { name = "Veines", desc = "Des veines entrecroisées de couleur corail et bleu sarcelle sont peintes sur cette arme.\n\nLa clé qui permet d'accéder au cœur d'un agent coûte 4 750 $" },
	["cu_cz75_cerakote"] = { name = "Usure", desc = "La finition en céramique couleur cuivre de cette arme s'érode au fil du temps.\n\nSe bonifie avec l'âge" },
	["cu_deagle_replica"] = { name = "Surcouche bleue", desc = "Un effet de bois stratifié a été appliqué à cette arme, et elle a été personnalisée d'un chargeur bleu et d'une crosse cendrée.\n\nAVERTISSEMENT : ceci est une réplique qui n'a jamais été testée en conditions réelles" },
	["cu_m4a1s_csgo2048"] = { name = "Joueur 2", desc = "Cette arme a été peinte avec des couleurs vives et personnalisée de versions animées d'un antiterroriste du GIGN et de Pop Dog.\n\nAppuyez sur Start..." },
	["cu_mac10_nacre"] = { name = "Disco-tech", desc = "Cette arme a été peinte sur mesure à l'aide d'un motif nacré de façon à ressembler à un vinyle holographique et autoadhésif. Elle change d'apparence en fonction de la lumière.\n\nAdmirez ces motifs chatoyants quand vous visez " },
	["gs_mag7_justice"] = { name = "Justice", desc = "L'apparence de cette arme est inspirée de la carte de tarot de la Justice.\n\nPersonne n'échappe à la justice" },
	["cu_mp5_desert_strike"] = { name = "Desert Strike", desc = "Cette arme a été personnalisée d'un design high-tech beige et noir.\n\nPremière et dernière frappes" },
	["cu_negev_prototype"] = { name = "Prototype", desc = "Un motif blanc et rouge censé être temporaire a été appliqué à cette arme le temps que sa finition soit mise au point.\n\nv1.2.1, PAT. 3422107" },
	["aq_p2000_acid_clover"] = { name = "Eau-forte", desc = "Un motif multicolore aléatorisé ainsi qu'un trèfle à quatre feuilles ont été appliqués à cette arme.\n\nAu petit bonheur la chance" },
	["gs_r8_leviathan"] = { name = "Carcasse", desc = "Les restes d'une créature marine mythique ont été peints sur le chargeur de ce revolver.\n\nRegardez toujours sous vos pieds" },
	["cu_sawedoff_apocalypto"] = { name = "Apocalypto", desc = "Une main en décomposition qui essaye d'attraper une planète en forme de bombe a été peinte par-dessus une couche violette qui représente l'espace.\n\n« T'aurais pas l'heure ? »" },
	["gs_scar20_enforcer"] = { name = "Exécuteur", desc = "Un dégradé aux couleurs du coucher de soleil a été peint méticuleusement sur les diverses parties de cette arme.\n\nSolutions automatiques conçues par SYMETRY SMART GUN CORP" },
	["cu_sg553_darkwing"] = { name = "Aile noire", desc = "Un motif rouge et noir, des plumes et d'autres détails sinistres ont été appliqués à cette arme.\n\nRegard d'aigle et pouvoir meurtrier : vous ne trouverez pas d'oiseau aptère plus dangereux" },
	["cu_ssg08_fever_dream"] = { name = "Hallucinations", desc = "Des dessins roses, bleus et violets dignes d'un psychopathe ont été peints par-dessus une couche noire.\n\nH@@HH@H@H@HA !!" },
	["cu_glock18_warmaiden"] = { name = "Franc-tireuse", desc = "Des balles patibulaires et une demoiselle de guerre à la veste rose ont été peintes par-dessus une couche jaune et noir.\n\n« J'arrêterai de tirer quand tu te tairas »" },
	["cu_negev_ultralight"] = { name = "Phosphore", desc = "Un motif de camouflage numérique gris avec des flèches turquoises a été appliqué à cette arme.\n\nT'as du feu ?" },
	["cu_ak47_anubis"] = { name = "Légion d'Anubis", desc = "Le motif appliqué à cette arme représente les dieux égyptiens Anubis et Ra, qui symbolisent l'équilibre entre la vie et la mort.\n\nPuisse sa balance vous être favorable" },
	["aq_p2000_lost_world"] = { name = "Entrelacs", desc = "Le corps tordu d'un extraterrestre s'étend de la culasse jusqu'au magasin de ce P2000 peint à la main.\n\nD'entre les recoins sombres du vide infini" },
	["cu_mag7_monster_call"] = { name = "Appel du monstre", desc = "Cette arme a été personnalisée avec des créatures marines peintes sur une couche bleue.\n\nIl y a toujours un poisson plus gros et plus vert" },
	["cu_printstream"] = { name = "Iconographie", desc = "Cette arme a été peinte avec un motif contrasté noir et blanc et une finition nacrée.\n\nBLANC_1; NOIR_1; NACRE_1;" },
	["cu_glock_eyecontact"] = { name = "Style", desc = "Deux yeux embellissent la culasse de ce Glock personnalisé aux couleurs du pop art.\n\n« Regarde-moi quand je te tire dessus ! »" },
	["gs_tec9_guerilla"] = { name = "Frère d'armes", desc = "Cette arme a été personnalisée avec un motif de camouflage marron et doré, ainsi que le visage d'un terroriste derrière le cran de mire.\n\nProtection assurée" },
	["cu_mac10_isoonna"] = { name = "Charme", desc = "Une femme habillée de turquoise, vraisemblablement une iso onna, est entourée de vagues déchaînées et de carpes koïs.\n\nBeauté fatale" },
	["gs_sg553_rusty"] = { name = "Oxydation", desc = "L'humidité a fait son œuvre sur cette arme à l'aspect original d'acier poli. L'inscription « Ol' Rusty » a été appliquée sur le logement de la gâchette.\n\nLes vieux amis sont les plus fidèles" },
	["cu_ssg08_mainframe"] = { name = "Macroordinateur 001", desc = "Un motif évoquant la « high tech » dans les tons bleus et violets a été appliqué sur cette arme.\n\nQuels secrets détient _001 ?" },
	["cu_p250_cassette"] = { name = "Cassette", desc = "Un motif inspiré par les jaquettes de cassettes vidéo des années 90 a été appliqué sur cette arme.\n\nRegardez la cassette" },
	["gs_p90_container"] = { name = "Fret", desc = "Le motif appliqué à cette arme ressemble à un wagon couvert de graffitis.\n\nL'art n'est pas du vandalisme" },
	["cu_xm1014_amulet_blue"] = { name = "Vestige", desc = "Enfoui pendant des millénaires, ce XM-1014 récemment exhumé arbore des bandelettes bleues et des motifs égyptiens.\n\nDigne d'un pharaon" },
	["cu_m4a4_queenfairy"] = { name = "Fée des dents", desc = "Une version effrayante de la fée des dents, accompagnée d'incisives et de molaires, décore cette arme.\n\nQuand vous avez une dent..." },
	["gs_galil_phoenix"] = { name = "Connexion", desc = "Des logos de la faction Phoenix ont été bombés sur une base rouge et blanc.\n\nIls sortent les gros calibres" },
	["gs_bizon_hellraider"] = { name = "Runes", desc = "Cette décoration personnalisée présente des runes d'origine inconnue et un chargeur rappelant une mitrailleuse Gatling.\n\nMontrez-leur l'enfer" },
	["gs_mp5sd_wasteland_legacy"] = { name = "Collage", desc = "Adhésif, attaches et colle maintiennent le résultat de vingt ans de design de MP5.\n\nOn ne réussit pas toujours du premier (ou deuxième ou troisième) coup…" },
	["gs_awp_exoskeleton"] = { name = "Exosquelette", desc = "Des motifs de crânes imbriqués ont été imprimés avec finesse sur le métal de cet AWP.\n\nPleine inclinaison" },
	["gs_cz75_vendetta"] = { name = "Vendetta", desc = "Cette arme a durci à force d'être utilisée, et les années lui ont apporté gravures et dessins.\n\nPas tant que je serai en vie" },
	["hy_p90_dino_rampage"] = { name = "Fureur du jurassique", desc = "Cette arme est ornée d'un motif hydrographique dans les tons olive et or représentant des dessins de dinosaures.\n\nDes dinos avec des aliens et des météorites, oulala !" },
	["gs_dual_elites_dezastre"] = { name = "Dézastre", desc = "Cette arme a été personnalisée avec un motif hi-tech noir, blanc et rouge.\n\nSuivre les recommandations du fabricant pour une utilisation en toute sécurité" },
	["cu_five_seven_diary"] = { name = "Conte de fées", desc = "Sur cette arme personnalisée, on voit une princesse, des licornes, de jolies fleurs et un lointain château.\n\n« Aujourd'hui, ça va être une bonne journée. Je le sens. »" },
	["gs_g3sg1_disrupt"] = { name = "Maillage numérique", desc = "Un motif de camouflage numérique rouge, blanc et anthracite a été appliqué à cette arme.\n\nD'une complexité troublante" },
	["gs_galil_vandal"] = { name = "Vandalisme", desc = "Des dessins blancs épars viennent recouvrir la couleur verte de cette arme.\n\nChaque dessin raconte une histoire, et certaines nous marquent davantage" },
	["cu_p250_infect"] = { name = "Contamination", desc = "L'enrobage marron de cette arme s'est érodé avec le temps, dévoilant une arme détériorée avec une faible durée de vie.\n\nC'est aussi piteux que ça en a l'air" },
	["cu_m249_deep_relief"] = { name = "Tout en relief", desc = "D'une couleur sable, la couche superficielle laisse progressivement place à des tons verts de plus en plus foncés pour les couches inférieures. C'est une finition d'arme qui mise sur le toucher.\n\nCombien de balles pour atteindre le centre ?" },
	["cu_m4a4_cyberpunk"] = { name = "Cybersécurité", desc = "Des bandes diagonales bleues, rouges et dorées ont été peintes par-dessus la couche noire de ce M4.\n\nMAINTENANT EN VENTE DANS VOTRE MAGASIN DE CYBERNÉTIQUE LE PLUS PROCHE" },
	["gs_mp5_conditionzero"] = { name = "Condition Zero", desc = "Le motif jaune et bleu de cette arme rend hommage à Counter-Strike: Condition Zero.\n\n« Lance-roquettes à trois heures ! Attention ! »" },
	["cu_nova_polymer"] = { name = "Polymère transparent", desc = "Cette arme a été peinte pour donner l'illusion que son revêtement est transparent, vous permettant de voir à l'intérieur.\n\nL'objectif est clair" },
	["cu_glock_noir"] = { name = "Néo-noir", desc = "Cette arme a été personnalisée avec une figure féminine bleu-magenta stylisée, reposant sur un fond de nuances de gris.\n\n« Les choses semblaient s'arranger et elle se remit à espérer. C'est à ce moment qu'elle leva la tête... »" },
	["cu_ssg08_chromatic"] = { name = "Parallaxe", desc = "Les couleurs de la finition de cette arme ont été appliquées en décalé, ce qui les fait ressortir.\n\nDeux tirs, une victime" },
	["gs_ump_gold_bismuth"] = { name = "Bismuth doré", desc = "Un motif en bismuth doré est incrusté entre la partie blanche et la partie noire de l'arme.\n\n« Vous avez le goût du luxe... »" },
	["cu_usp_krokos"] = { name = "Monstres et compagnie", desc = "Le motif de cette arme représente un monstre vert et quelques symboles qui s'inspirent de l'art urbain. Une finition nacrée a été appliquée sur le silencieux.\n\nX__X" },
	["cu_csgo_camo"] = { name = "Global Offensive", desc = "Cette arme est peinte d'un camouflage bleu, jaune et gris.\n\n« Nous établirons un premier contact à Harz, en Allemagne, à 17 h 25 GMT+1... »" },
	["am_authority_brown"] = { name = "Grande Charte", desc = "Des couronnes, des gribouillis et des esquisses de la Magna Carta recouvrent cette arme dans les tons cuivrés.\n\nTout le monde a droit à un procès équitable, même vous" },
	["hy_authority_purple"] = { name = "Magna Carta", desc = "Des couronnes, des gribouillis et des esquisses de la Magna Carta recouvrent cette arme dans les tons violets.\n\nTout le monde a droit à un procès équitable, même vous" },
	["am_intelligence_grey"] = { name = "Surveillance", desc = "Un motif de carte superposée avec une vue panoramique tête haute a été appliqué sur cette arme.\n\nCible acquise" },
	["am_intelligence_orange"] = { name = "Menace détectée", desc = "Un motif de carte superposée avec une vue panoramique tête haute a été appliqué sur cette arme.\n\nCible acquise" },
	["am_intelligence_magenta"] = { name = "Cible acquise", desc = "Un motif de carte superposée avec une vue panoramique tête haute a été appliqué sur cette arme.\n\nCible acquise" },
	["am_numbers_bronze"] = { name = "Bronze", desc = "Cette arme est ornée d'un motif représentant des nombres aléatoires de toutes les couleurs.\n\nLes nombres ne mentent pas, mais moi si" },
	["am_numbers_red_blue"] = { name = "Faucheuse", desc = "Cette arme est ornée d'un motif représentant des nombres aléatoires de toutes les couleurs.\n\nLes nombres ne mentent pas, mais moi si" },
	["hy_numbers_green"] = { name = "Tableau électrique", desc = "Cette arme est ornée d'un motif représentant des nombres aléatoires de toutes les couleurs.\n\nLes nombres ne mentent pas, mais moi si" },
	["am_numbers_magenta"] = { name = "Conspiration première", desc = "Cette arme est ornée d'un motif représentant des nombres aléatoires de toutes les couleurs.\n\nLes nombres ne mentent pas, mais moi si" },
	["aa_fade_red_blue"] = { name = "Gyrophares", desc = "Une moitié de la glissière a été peinte en rouge, l'autre en bleu.\n\nWouhou !" },
	["cu_ump_crime_scene"] = { name = "Scène de crime", desc = "Cette arme a été peinte avec une base rouge et bleue, sur laquelle a été appliqué un motif de ruban de signalisation\n\nCirculez, y a rien à voir…" },
	["am_m4a1s_bluesmoke"] = { name = "Bleu phosphorescent", desc = "Plusieurs couches d'un bleu métallique ont été appliquées par-dessus une couche de base d'un bleu chromatique. \n\nT'as le blues ?" },
	["cu_ak_xray"] = { name = "Rayons X", desc = "Un AK-47 personnalisé avec une radio de ses entrailles.\n\nCes révélations pourraient ne pas te plaire..." },
	["am_heist_plans_green"] = { name = "Braquage", desc = "Un plan de couleur beige anodisé a été appliqué en guise de base sur cette arme. On dirait que quelqu'un a dessiné sur ce plan après son application.\n\nPlanifier, c'est une chose, c'en est une autre d'exécuter" },
	["am_heist_plans_purple"] = { name = "Braquage de nuit", desc = "Un plan de couleur pourpre anodisé a été appliqué en guise de base sur cette arme. On dirait que quelqu'un a dessiné sur ce plan après son application.\n\nPlanifier, c'est une chose, c'en est une autre d'exécuter" },
	["am_heist_plans_yellow"] = { name = "Braquage de coffre", desc = "Un plan de couleur gris anodisé a été appliqué en guise de base sur cette arme. On dirait que quelqu'un a dessiné sur ce plan après son application.\n\nPlanifier, c'est une chose, c'en est une autre d'exécuter" },
	["hy_houndstooth_brown"] = { name = "Pied-de-poule", desc = "Cette arme est ornée d'un motif hydrographique pied-de-poule brun.\n\nÉquipe-toi pour le rôle que tu veux, pas celui que tu as" },
	["gs_mac10_snake"] = { name = "Serpents ardents", desc = "Cette arme a été personnalisée avec des motifs bronze de peau de serpent et un serpent enroulé.\n\nLes sifflements que tu entends, ce sont les balles autour de toi" },
	["hy_phoenix_tags_lilac"] = { name = "Craie Phoenix", desc = "Un motif multicolore composé de divers graffitis de Phoenix Connexion a été appliqué.\n\n« Vous êtes stupides de penser que vous allez gagner ! »" },
	["am_phoenix_tags_blue"] = { name = "Marque du Phoenix", desc = "Un motif multicolore composé de divers graffitis de Phoenix Connexion a été appliqué.\n\n« On ne peut plus nous arrêter maintenant ! »" },
	["hy_phoenix_tags_red"] = { name = "Pochoir Phoenix", desc = "Un motif multicolore composé de divers graffitis de Phoenix Connexion a été appliqué.\n\n« On est invulnérables. »" },
	["sp_phoenix_tags_purple"] = { name = "Lumière noire Phoenix", desc = "Un motif multicolore composé de divers graffitis de Phoenix Connexion a été appliqué.\n\n« Nous irons danser sur vos tombes. »" },
	["hy_tigers_tan"] = { name = "Embuscade argileuse", desc = "Un motif hydrographique tigré dans les tons bruns et cuivrés a été appliqué.\n\nCe sont des prédateurs solitaires, mais pour vous, ils feront une exception" },
	["am_tigers_brown"] = { name = "Fosse aux tigres", desc = "Un motif hydrographique tigré dans les tons cuivrés a été appliqué sur une base noire.\n\nN'importe où sauf ici" },
	["am_tigers_blue"] = { name = "Tigre de soie", desc = "Un motif hydrographique tigré a été appliqué sur une base bleue.\n\nC'est un trésor national (le tigre, pas l'AWP)" },
	["cu_m4a1_snake"] = { name = "Bienvenue dans la jungle", desc = "Ce motif personnalisé met en scène une iconographie ancienne et une fosse à vipères dorée devant un paysage pittoresque de jungle.\n\nFrappez sans prévenir" },
	["cu_ak_jaguar"] = { name = "Panthera onca", desc = "Les magnifiques ciselures du bois de la crosse et du garde-main de cette arme volent souvent la vedette au motif personnalisé de jaguar peint sur le côté.\n\nQui a dit qu'on ne pouvait pas changer de peau ?" },
	["cu_jaguar_p90"] = { name = "Cours te cacher", desc = "Cette arme a été peinte d'un motif jaguar avec une finition en cuir craquelé.\n\nTout le monde peut entrer dans la mode, mais peu de personnes qui le font avec style." },
	["aa_ancient_brown"] = { name = "Terre ancestrale", desc = "Un motif brun et or avec un entrelacs complexe et des créatures ancestrales a été appliqué.\n\nÀ vous l'honneur" },
	["am_ancient_warm"] = { name = "Histoire ancienne", desc = "Cette arme est recouverte d'un motif aux tons pâles teinté de vert, de beige et de rouge imitant un carrelage ancien.\n\n« L'espoir persiste, même pour celles et ceux qui ont commencé leur périple sur le mauvais chemin. »" },
	["aa_ruins_green"] = { name = "Ruines luxuriantes", desc = "D'antiques dieux se cachent à l'arrière-plan de ce motif orné de feuilles.\n\n« Levez les yeux, on nous observe... »" },
	["hy_ancient_tiles_peach"] = { name = "Attrait du passé", desc = "Cette arme est recouverte d'un motif aux tons pâles teinté de vert et de beige imitant un carrelage ancien.\n\n« L'espoir persiste, même pour celles et ceux qui ont commencé leur périple sur le mauvais chemin. »" },
	["am_gold_brick"] = { name = "Lingot d'or", desc = "Cette finition dorée brille à la lumière et souligne chaque imperfection qui fait la beauté de l'arme.\n\nTout ce qui brille..." },
	["sp_ancient_bright"] = { name = "Visions antiques", desc = "Un motif vert et rouge avec un entrelacs complexe et des créatures ancestrales a été appliqué.\n\nÀ vous l'honneur" },
	["hy_ruins_red"] = { name = "Ruines crépusculaires", desc = "D'antiques dieux se cachent à l'arrière-plan de ce motif orné de feuilles.\n\n« Levez les yeux, on nous observe... »" },
	["am_jade"] = { name = "Jade sculpté", desc = "Cette arme a été peinte avec une base chromée et vieillie enrobée d'une couche vert jade transparente à l'effet anodisé.\n\nLa crème de la crème" },
	["am_ancient_wine"] = { name = "Rituel ancien", desc = "Un motif marron et argent avec un entrelacs complexe et des créatures ancestrales a été appliqué.\n\nÀ vous l'honneur" },
	["hy_drywood_green"] = { name = "Hautes herbes", desc = "Un motif hydrographique vert gazon a été appliqué.\n\nIl ne se passe jamais rien de bon dans les hautes herbes" },
	["am_black_panther"] = { name = "Camouflage panthère", desc = "Une finition tachetée façon panthère noire a été appliquée.\n\nTrouvez votre coin d'ombre" },
	["gs_ak47_professional"] = { name = "Ardoise", desc = "Une finition personnalisée a été appliquée à cet AK-47. Il n'y a pas d'autres mots pour la décrire que « noir sur noir sur du noir ardoise ».\n\n« Appelez un médecin, on va en avoir besoin. »" },
	["cu_cz75_whirlwind"] = { name = "Circaetus", desc = "Un oiseau de proie enserrant un serpent a été peint sur ce CZ75.\n\nUn charmeur de serpents, sans la flute." },
	["cu_mp9_food_chain"] = { name = "Chaine alimentaire", desc = "Ce MP9 aux couleurs vives a été peint d'une chaine alimentaire monstrueuse.\n\nManger ou se faire manger" },
	["cu_galil_chroma_pink"] = { name = "Aberration chromatique", desc = "Les couleurs de la finition de cette arme ont été appliquées en décalé, ce qui les fait ressortir.\n\n(Pas si) reposant pour les yeux..." },
	["gs_glock_polymer"] = { name = "Polymère transparent", desc = "La glissière de cette arme a été peinte en beige et sa gâchette en bleu. Sa carcasse est faite de polymère transparent.\n\nOn ne ment pas sur la marchandise." },
	["gs_usps_hangedman"] = { name = "Traitre", desc = "L'apparence de cette arme est inspirée de la carte de tarot du Pendu.\n\nLes échecs passés sont les ébauches des réussites futures" },
	["cu_m4a4_love"] = { name = "Psychédélique", desc = "Des motifs dessinés à la main viennent recouvrir les couleurs néon de cette arme.\n\nOn mène le même combat." },
	["gs_m249_combine"] = { name = "O.S.I.P.R.", desc = "Cette M249 a été peinte en gris foncé et personnalisée d'un logo du Cartel.\n\nFusil à impulsion standard de la milice" },
	["cu_negev_devtexture"] = { name = "texture_dév", desc = "Des textures de développement grises ont été appliquées sur un fond orange.\n\nIl est l'heure de lancer hammer.exe" },
	["gs_p250_cybershell"] = { name = "Cyberbouclier", desc = "La glissière de cette arme a été peinte en argent, et des textures en forme d'hexagones viennent décorer la poignée.\n\nVous êtes en première ligne contre les attaques de cybersécurité" },
	["cu_mac10_portable"] = { name = "Presse-bouton", desc = "Cette arme a été personnalisée pour ressembler à une manette de jeu. Des boutons sortent de la structure en polymère transparent.\n\nL'expression « guerre des consoles » prend ici un tout autre sens" },
	["aq_xm1014_punk"] = { name = "XOXO", desc = "Un motif aux couleurs vives et inspiré du mouvement punk a été appliqué à cette arme.\n\nOuais, bien sûr…" },
	["gs_r8_rustking"] = { name = "Décharge", desc = "Des dessins et des inscriptions en argent recouvrent la couche bleue de cette arme. Le cylindre et la mire ont été peintes en rouge.\n\nDigne d'un roi" },
	["gs_sg553_deathmetal"] = { name = "Heavy métal", desc = "Des rehauts orange et jaunes appliqués sur la base noire de cette arme lui donnent sa touche de finition. Trois étoiles ont été peintes à l'arrière de la crosse.\n\n« Un de ces rivets correspond au bouton turbo, mais je ne sais plus lequel... »" },
	["am_ump45_electrowave"] = { name = "Oscillateur", desc = "Un motif aléatoire orange, noir et gris a été appliqué à cette arme.\n\nTout le monde a des limites : quelles sont les vôtres ?" },
	["cu_deag_trigger_discipline"] = { name = "Discipline de la détente", desc = "Un motif isométrique rose a été peint sur le canon de cette arme. La mire et le chien ont été peints en bleu vif.\n\nLa patience est toujours récompensée" },
	["sp_nova_wind_dispersal"] = { name = "Pissenlit", desc = "Un champ de pissenlits au motif aléatoire a été peint à la bombe.\n\nDégagez de mon jardin !" },
	["am_nuclear_pattern4_famas"] = { name = "Fusion", desc = "Un motif de symboles de danger nucléaire a été appliqué sur cette arme à l'aide d'une peinture métallique.\n\nGarde tes distances quelque temps…" },
	["aa_spacerace_orange"] = { name = "Course à l'espace", desc = "Un motif spatial ponctué d'étoiles et de satellites a été appliqué à cette arme.\n\nTransmission et réception." },
	["sp_spacerace_blue"] = { name = "Spoutnik", desc = "Un motif spatial ponctué d'étoiles et de satellites a été appliqué à cette arme.\n\nTransmission et réception." },
	["sp_technowar_red"] = { name = "Pschitt", desc = "Un motif beige et rouge rappelant la techno rétro a été appliqué à cette arme.\n\nLes guerres se gagnent à coups de renseignements." },
	["hy_technowar_rwb"] = { name = "AWPop art", desc = "Un motif blanc, rouge et bleu rappelant la techno rétro a été appliqué à cette arme.\n\nLes guerres se gagnent à coups de renseignements." },
	["hy_trainarchitect_green"] = { name = "Twill printanier", desc = "Un motif noir et vert d'ornements assortis a été peint sur cette arme par hydrographie.\n\nDernier appel : le train est sur le point de quitter la gare." },
	["hy_trainarchitect"] = { name = "Twill automnal", desc = "Un motif rouge et beige d'ornements assortis a été peint sur cette arme par hydrographie.\n\nDernier appel : le train est sur le point de quitter la gare." },
	["gs_m4a4_coalition"] = { name = "La Coalition", desc = "Un motif doré et noir personnalisé composé de triangles entrelacés et de rehauts de bleu a été appliqué à cette arme.\n\nCette alliance est temporaire, mais je pourrais changer d'avis…" },
	["cu_mac10_propaganda"] = { name = "Propagande", desc = "Une paire d'yeux et quelques mots en russe, notamment « contrôle » et « peur », ont été peints sur cette arme.\n\nTu ne vas pas les croire, quand même ?" },
	["gs_train_cz75"] = { name = "Syndicat", desc = "Un motif doré et noir personnalisé composé de triangles entrelacés et de rehauts de bleu a été appliqué à cette arme.\n\nOn y va ensemble." },
	["hy_ak47lam_green"] = { name = "Vert stratifié", desc = "La crosse, la poignée et le garde-main de cet AK-47 ont été recouverts de bois stratifié vert.\n\nLe bonheur est dans les choses simples." },
	["sp_galil_caution"] = { name = "ATTENTION !", desc = "Des chevrons noir et jaune vifs ont été peints à la bombe sur cette arme.\n\nTransforme l'inconfort en confort." },
	["hy_geometric_steps_pearl"] = { name = "Terrasse prismatique", desc = "Un motif d'illusion d'optique nacré a été appliqué à cette arme.\n\nOù est-ce que ça commence ? Où est-ce que ça s'arrête ? Est-ce que ça s'arrête ?" },
	["gs_m4a1_vertigo"] = { name = "Danger imminent", desc = "Plusieurs panneaux de sécurité multicolores ont été peints sur cette arme.\n\nNe dis pas que tu savais pas… (Booth, trafiquant d'armes)" },
	["hy_vertigogeo"] = { name = "Schéma", desc = "Un motif multicolore d'une grille isométrique a été appliqué à cette arme.\n\nTu te rappelles la douleur, je me rappelle la victoire." },
	["hy_vertigospray_blue"] = { name = "Stratégie", desc = "Un motif représentant les plans de construction du 51ᵉ étage, conduits et câblage compris, a été peint sur cette arme par hydrographie.\n\nLe plan fonctionne comme prévu…" },
	["hy_vertigoillusion"] = { name = "Cadre", desc = "Un motif d'illusion d'optique gris et beige a été peint sur cette arme par hydrographie.\n\nT'as bien regardé ?" },
	["hy_vertigoillusion_yellow"] = { name = "Antidémarrage", desc = "Un motif d'illusion d'optique jaune et bleu a été peint sur cette arme par hydrographie.\n\nT'as bien regardé ?" },
	["hy_vertigospray"] = { name = "Infrastructure", desc = "Un motif représentant les plans de construction du 51ᵉ étage, conduits et câblage compris, a été peint sur cette arme par hydrographie.\n\nLe plan fonctionne comme prévu…" },
	["aa_vertigogeo_neon"] = { name = "Architecte numérique", desc = "Un motif multicolore d'une grille isométrique a été appliqué à cette arme.\n\nTu te rappelles la douleur, je me rappelle la victoire." },
	["cu_sg553_caution"] = { name = "Prime de risque", desc = "Des rehauts d'orange ont été appliqués sur une couche jaune pour évoquer les couleurs des plots de signalisation.\n\nFais fi de toute prudence… une balle à la fois." },
	["aa_wiring"] = { name = "Disjoncteur", desc = "Un motif de schéma de câblage a été appliqué à cette arme par anodisation.\n\nPrenez contact avec une personne spécialisée avant de réparer vous-même votre installation électrique." },
	["aa_wiring_yellow"] = { name = "Câblage défectueux", desc = "Un motif de schéma de câblage a été appliqué à cette arme.\n\nPrenez contact avec une personne spécialisée avant de réparer vous-même votre installation électrique." },
	["sp_engine_dirty"] = { name = "Vidange", desc = "Un motif de pièces de moteur a été peint à la bombe sur cette arme.\n\n« Ça sent pas bon… »" },
	["aa_engine_performance"] = { name = "Mécanisme", desc = "Un motif de pièces de moteur a été appliqué à cette arme par anodisation.\n\n« Ça sent pas bon… »" },
	["cu_vertigo_fiveseven"] = { name = "Risque de chute", desc = "Cette arme a été peinte avec plusieurs couleurs et agrémentée des mots « TOMBER » et « CONSTRUCTION » en anglais.\n\nAttention de ne pas tomber." },
	["sp_tire_tread_red"] = { name = "Pneu rouge", desc = "Des motifs de traces de pneu noir et rouge ont été peints à la bombe sur cette arme.\n\nFaites chauffer les pneus." },
	["sp_tire_tread_blue"] = { name = "Pneu bleu", desc = "Des motifs de traces de pneu noir et bleu ont été peints à la bombe sur cette arme.\n\nFaites chauffer les pneus." },
	["gs_ak47_abstract"] = { name = "Galerie d'élite", desc = "Une représentation cubiste de terroristes de l'unité d'élite en train de se faufiler dans le couloir A de Dust II orne cette arme.\n\n« Tout ce que tu peux imaginer est réalité. »" },
	["gs_aug_plague"] = { name = "Fléau", desc = "L'apparence de cette arme est inspirée des univers de l'horreur et de la dark fantasy.\n\n« Comme un papillon de nuit attiré par la lumière. »" },
	["gs_mag7_bismuth"] = { name = "Spectre Bi83", desc = "Le motif appliqué à cette arme ressemble à des cristaux de bismuth iridescents.\n\nPourquoi les choses les plus rares sont-elles les plus belles ?" },
	["cu_deagle_kitch"] = { name = "Bordure d'océan", desc = "Des couleurs sursaturées et des formes diverses figurent sur cette arme.\n\nImpossible de rater les couleurs ou les tirs." },
	["gs_dual_berettas_tread"] = { name = "Nervures", desc = "Les deux Berettas ont été gravés à la main en utilisant un motif de vagues. Les chargeurs ont été peints en or.\n\nLes petits détails sont ceux qui prennent le plus de temps, qui ajoutent le plus de valeur et qui sont le moins remarqués." },
	["cu_famas_spectron"] = { name = "ZX Spectron", desc = "L'apparence de cette arme est inspirée des anciens PC de jeu. Sa couche noire a été agrémentée de rehauts multicolores.\n\nClive serait fier." },
	["gs_five_seven_efusion"] = { name = "Protocole d'impulsion", desc = "Des couleurs vives recouvrent cette arme. L'icône de robot derrière le cran de mire correspond au dessin sur le chargeur.\n\nNom de code : MÉCHA 0272." },
	["aa_mp9_fuji_pink"] = { name = "Mont Fuji", desc = "Une représentation du Mont Fuji au lever du jour a été peinte à l'acrylique sur cette arme. Cette peinture est utilisée comme motif, ce qui signifie que chaque arme peut avoir un visuel différent.\n\nLe soleil rouge se lève." },
	["cu_g3sg1_tacticalmap"] = { name = "Sous surveillance", desc = "L'apparence de cette arme s'inspire de la carte tactique affichée en mode Zone de danger.\n\nTu as toutes les informations dont tu as besoin. (Franz Kriegeld, tacticien de The Phoenix)" },
	["cu_mp7_khaki"] = { name = "Guérilla", desc = "Un singe qui regarde vers l'avant a été peint sur une couche verte agrémentée de détails noirs.\n\nLe lion n'a jamais été le roi de la jungle." },
	["gs_m4_flowers"] = { name = "Lycoris", desc = "Une couche bleu sombre a été peinte sur cette arme, et agrémentée de lycoris rouges au-dessus du chargeur et de la gâchette.\n\nLes couleurs vives sont un avertissement, pas une invitation" },
	["cu_mac10_toybox"] = { name = "Boite à jouets", desc = "Des dessins aux couleurs vives de poulets, d'extraterrestres, d'antiterroristes et d'autres viennent personnaliser cette arme.\n\nRange ton fatras." },
	["gs_bizon_flasher"] = { name = "Lumen", desc = "Cette arme a été peinte en noir et agrémentée de rehauts rouges. Le chargeur a été peint de manière à ressembler à une lampe-torche.\n\nÉclaire la voie." },
	["cu_glock_snackattack"] = { name = "Attaque gloutonne", desc = "Cette arme a été peinte avec de petites représentations de friandises et autres aliments industriels suspendus dans de la résine.\n\nLa malbouffe contrattaque." },
	["cu_ssg_overtake"] = { name = "Mode turbo", desc = "Des voitures de sport dévalent ce fusil de précision peint avec des couleurs néon.\n\nFaire des drifts, c'est un droit, pas un privilège." },
	["cu_usp_black_lotus"] = { name = "Lotus noir", desc = "Un lotus noir a été peint sur le chargeur de cette arme.\n\nFait 3 victimes pendant la première manche, puis est laissé de côté." },
	["gs_xm1014_watchdog"] = { name = "Lion de garde", desc = "Une couche vert jade et deux lions de garde regardant dans la direction opposée ont été peints sur cette arme. Un troisième a été peint sous le cran de mire.\n\nProtéger et prospérer." },
	["cu_ak47_nightwish"] = { name = "Songe nocturne", desc = "Cette arme a été personnalisée avec un élan et des attrape-rêves aux couleurs néon. Une finition nacrée y a été appliquée en dernière touche.\n\nJ'attendais le bon moment pour la sortir… (Booth, trafiquant d'armes)" },
	["cu_bizon_spacecat"] = { name = "Chat sidéral", desc = "Cette arme a été personnalisée avec la représentation d'un chat dans l'espace sur une base noire et violette.\n\nLes pattes de la création" },
	["cu_elites_beware"] = { name = "Pastèque effrayante", desc = "Ces Dual Berettas ont été personnalisés avec la représentation cauchemardesque d'une pastèque sur un fond bleu marine.\n\nFaites de beaux rêves…" },
	["gs_famas_rapid_eyes"] = { name = "Mouvement oculaire rapide", desc = "Cette arme a été personnalisée avec des carrés roses imbriqués. Les carrés sont illustrés d'yeux réalistes.\n\nLes yeux rêveurs papillonnent frénétiquement" },
	["cu_fiveseven_alpha_omega"] = { name = "Griffonnage", desc = "Ces motifs graphiques ont été faits à la main à la peinture noire sur une base jaune et bleu canard.\n\nL'alpha et l'oméga" },
	["cu_g3sg1_glade"] = { name = "Clairière onirique", desc = "Une forêt verte cède la place à un ciel bleu au centre de cette finition d'arme personnalisée.\n\n« Là, une clairière dans la forêt ! »" },
	["gs_m4a1s_insomnia"] = { name = "Terreur nocturne", desc = "Les pensées dispersées d'un esprit insomniaque ont été gribouillées sur ce M4A1-S personnalisé.\n\nC'est au sein de la nuit douce que je recherche la lumière" },
	["cu_mac10_pixie"] = { name = "Attrape-fées", desc = "Cette finition d'arme a été personnalisée avec de petites fées prises au piège à l'intérieur de l'arme et désireuses de s'en échapper.\n\nPersonne ne résiste à leurs espiègleries" },
	["cu_mag7_predictor"] = { name = "Prévoyance", desc = "Cette arme personnalisée représente une pieuvre invitée à prédire le résultat d'un match et qui s'apprête à saisir la tablette « victoire ».\n\nLa chance va me sourire…" },
	["cu_mp7_fear"] = { name = "Spectres des abysses", desc = "Cette arme personnalisée représente des âmes abandonnées tombant dans un gouffre de cauchemars.\n\nOn ne peut pas échapper à son destin" },
	["gs_mp9_starlight"] = { name = "Protectrice étincelante", desc = "Cette arme personnalisée est illustrée d'une licorne à la crinière arc-en-ciel sur un fond blanc et arbore des finitions dorées.\n\nPuisse la divinité vous protéger si elle vous affectionne" },
	["am_xm_zombie_offensive"] = { name = "Offensive zombie", desc = "Cette arme personnalisée arbore un motif d'éléments de Counter-Strike transformés en zombies.\n\n« Ce jeu n'est pas mort »" },
	["cu_usp_to_hell"] = { name = "Billet pour l'enfer", desc = "Des motifs techniques blancs ont été peints sur mesure sur un fond noir. \n\nUn design mortifère" },
	["gs_mp5_kid_necronomicon"] = { name = "Nécro Jr.", desc = "Cette arme a été personnalisée avec des créatures inspirées des contes de fées et avec un poulet sur le silencieux.\n\nLa récréation est terminée !" },
	["cu_p2k_flying_dream"] = { name = "Esprits libérés", desc = "Cette arme a été personnalisée avec une forêt en dessous de corps qui s'élèvent dans les airs. \n\nNombre d'âmes perdues ne souhaitent pas être retrouvées" },
	["sp_scar_chickenfight"] = { name = "Volaille vivace", desc = "Cette arme personnalisée arbore un motif de poulets sur un champ de bataille.\n\nQuand un poulet monte sur un requin, la bataille s'annonce sanglante…" },
	["cu_sawedoff_ouija"] = { name = "Planche spirituelle", desc = "Cette arme personnalisée arbore un motif de planche utilisée pour invoquer les esprits.\n\n« Allez, je sais que c'est toi qui la déplaces… »" },
	["cu_ak47_cogthings"] = { name = "Glagla", desc = "Cette arme a été personnalisée avec un dégradé qui va du vert éclatant au bleu.\n\nFroide au toucher" },
	["cu_awp_chroma_pink"] = { name = "Aberration chromatique", desc = "Les couleurs de la finition de cette arme ont été appliquées en décalé, ce qui les fait ressortir.\n\n(Pas si) reposant pour les yeux…" },
	["gs_revolver_purple_elite"] = { name = "Grand huit", desc = "Cette arme personnalisée arbore un canon violet et le chiffre 8 sur la crosse.\n\nInspirée des évènements du 8 décembre 2015" },
	["gs_famas_corp_meow"] = { name = "Miaou 36", desc = "La base kaki de cette arme est ornée du chiffre 36.\n\nEn vérité, il y a quatre chats, mais qui prend la peine de compter ?" },
	["cu_galil_destroyer"] = { name = "Destruction", desc = "Cette arme personnalisée arbore le nom « DESTROYER », mais il ne peut être lu que sous certains angles.\n\nDestruction totale" },
	["cu_m249_downvote"] = { name = "La zone", desc = "Cette arme a été taguée avec des flèches bleues et roses pointant dans toutes les directions.\n\nC'est de la bombe !" },
	["cu_m4a4_elite_tactical"] = { name = "Polymère", desc = "Cette arme a été personnalisée avec un chargeur en polymère transparent. La crosse, le protège-main et la poignée ont été peints en beige.\n\nProcédure d'utilisation standard" },
	["cu_mac10_monkeyflage"] = { name = "Singes multicolores", desc = "De petits singes rouges, beiges et verts ornent ce MAC-10 personnalisé.\n\nQuels singes malicieux !" },
	["cu_sg553_cyber_dragon"] = { name = "Dragon technologique", desc = "Cette arme personnalisée représente un dragon vert biomécanique.\n\nCe n'est pas mon dragon…" },
	["cu_negev_clear_sky"] = { name = "Lâche-moi", desc = "Cette arme personnalisée arbore un panneau stop près de la poignée supérieure sur un fond principalement marron.\n\nSi le panneau stop ne vous arrête pas, la rafale de balles le fera" },
	["gs_p250_visions"] = { name = "Visions", desc = "Cette arme est personnalisée avec un motif chargé aux couleurs éclatantes.\n\nPour celles et ceux qui refusent de suivre la norme" },
	["gs_p90_tangled"] = { name = "Retour de flamme", desc = "Cette arme personnalisée ressemble à un P90 tombé dans un entrelacs de ruban adhésif, de tubes et de flammes.\n\n« Faut pas bruler les étapes »" },
	["cu_sawedoff_kisslove"] = { name = "BIS♥U", desc = "Cette arme personnalisée arbore une femme avec des étoiles dans les yeux dans des tons rosés et violets.\n\n« Ne me dites pas non, si je le veux je l'aurai ! »" },
	["cu_dual_elites_evil_flora"] = { name = "Flore carnivore", desc = "Trois plantes carnivores affamées aux couleurs vives ont été peintes sur chaque Dual Beretta.\n\nAidez-les à devenir grandes et fortes" },
	["gs_ump_roadblock"] = { name = "Route barrée", desc = "Cette arme est personnalisée avec des lignes orange horizontales superposées sur des chevrons tournés vers le canon.\n\nPrenez l'itinéraire bis" },
	["gs_glock_elite_camo"] = { name = "Saison d'hiver", desc = "Cette arme est personnalisée avec un camouflage militaire dans un coloris hivernal.\n\nAttention aux sueurs froides !" },
	["cu_mag7_insomnia"] = { name = "Insomnie", desc = "Cette arme a été personnalisée avec une illustration aux couleurs orange et noir représentant des poissons qui nagent vers la bouche ouverte d'une personne.\n\nGlou, glou, glou" },
	["cu_ak_head_shot_holo"] = { name = "Head Shot", desc = "Cette arme a été personnalisée avec le graffiti « HEAD SHOT GUN » recouvert d'une couche de finition nacrée.\n\nAvoir des ambitions, c'est une chose, les réaliser c'en est une autre - Booth, trafiquant d'armes" },
	["gs_awp_limbo_snake"] = { name = "Dualité", desc = "Un serpent a été peint des deux côtés de cette arme : l'un est rouge, l'autre est doré.\n\nIl faut toujours voir les deux côtés de la médaille" },
	["cu_m4a1s_feeding_frenzy"] = { name = "Emphorosauru-S", desc = "Cette arme a été personnalisée pour donner l'impression qu'un dinosaure déchire un côté de l'arme de ses griffes.\n\nAppétit vorace" },
	["cu_p2000_decline"] = { name = "Look d'enfer", desc = "Cette arme a été personnalisée avec des couleurs néons destinées à attirer (et conserver) votre attention.\n\nVotre attention s'il vous plait !" },
	["cu_ump_clutch_kick"] = { name = "Sale gosse", desc = "Cette arme a été personnalisée avec des dessins représentants des balles, une couronne et d'autres motifs. Des bandeaux aux couleurs néons recouvrent cet UMP-45.\n\nLe concept est simple, c'est l'exécution qui est difficile" },
	["cu_mp9_superlight"] = { name = "Poids plume", desc = "Cette arme a été personnalisée avec un motif en noir et blanc qui lui donne une apparence poreuse et semble réduire son poids.\n\nUn tireur sachant tirer…" },
	["gs_scar_fragments_black"] = { name = "Fragments", desc = "Cette arme a été personnalisée avec un motif couleur bronze autrichien qui donne l'illusion que la géométrie de l'arme a été modifiée.\n\nCe n'est que votre imagination" },
	["cu_glock_moon_rabbit"] = { name = "Lapin lunaire", desc = "Cette arme a été personnalisée avec une scène onirique représentant un lapin aux allures mystiques en plein bond, une pleine lune derrière lui.\n\nEt que ça saute !" },
	["cu_m4a4_temukau"] = { name = "Temukau", desc = "Cette arme a été personnalisée dans un style d'animation japonaise et représente une agente AT qui défend sa position lors d'un rush de l'équipe adverse.\n\n« Maintenez votre position ! »" },
	["cu_mac10_sakkaku"] = { name = "Sakkaku", desc = "Ce MAC-10 a été personnalisé avec un visage dont les yeux rouges deviennent scintillants en fonction de l'éclairage.\n\nSoyez leur pire cauchemar" },
	["cu_p250_rebuilt"] = { name = "Re.construction", desc = "Ce P250 a été personnalisé avec des triangles qui s'imbriquent et autres motifs minimalistes.\n\nCette fois, c'est la bonne" },
	["cu_mp5sd_quick_liquidation"] = { name = "Liquidation", desc = "Ce MP5-SD a été personnalisé avec une base sombre et des reflets rouges et bleus qui lui donne l'impression de luire sous une lumière ambiante.\n\nReflets subtils" },
	["gs_r8_banana"] = { name = "Calibre banane", desc = "Cette arme a été personnalisée pour ressembler à une banane très mûre.\n\nFaites les glisser" },
	["gs_p90_neoqueen"] = { name = "Néoreine", desc = "Cette arme a été personnalisée avec des motifs aux styles militaires et de science-fiction.\n\nConçue sur mesure pour foncer dans le tas" },
	["cu_sg553_cyberforce"] = { name = "Cyberforce", desc = "Cette arme a été personnalisée avec le logo CYBERFORCE INC appliqué sur un fond en rouge et noir.\n\n« CYBERFORCE INC : votre futur, on en fait notre affaire ! »" },
	["cu_tec9_freedom"] = { name = "Rebelle", desc = "Ce TEC-9 a été personnalisé avec plusieurs motifs aux couleurs pâles plus ou moins coordonnées.\n\nUn tir, une victime, une manche à la fois" },
	["gs_revolver_acanthus_bronze"] = { name = "Inlay", desc = "It has been custom painted to resemble acanthus engravings and a marble grip.\n\nOpulence in the palm of your hand" },
	["gs_ak47_strone"] = { name = "Steel Delta", desc = "The lines of this custom paint job resemble grooves on a topographical map.\n\nBleed between the lines" },
	["gs_awp_strone"] = { name = "Black Nile", desc = "The lines of this custom paint job resemble grooves on a topographical map.\n\nBleed between the lines" },
	["cu_glock_ramzes"] = { name = "Ramese's Reach", desc = "The Nile river has been custom painted on the slide and the grip depicts Ramesses I, the founding pharaoh of ancient Egypt's 19th Dynasty.\n\n\"My people reach for their Gods, and I am here to connect them\"" },
	["cu_famas_holo_ocean"] = { name = "Waters of Nephthys", desc = "The blues on this custom painted FAMAS shift as lighting conditions change.\n\nWater always wins" },
	["cu_m249_scarab"] = { name = "Submerged", desc = "It has been custom painted using teal-colored desert camouflage and environments as inspiration.\n\n\"WE'VE BEEN SET UP! THEY'RE EVERYWHERE!\"" },
	["gs_m4a1s_milspec"] = { name = "Mud-Spec", desc = "A custom black and brown camouflage has been applied.\n\nBackup has arrived" },
	["gs_m4a4_ra"] = { name = "Eye of Horus", desc = "It has been custom painted with a white base, gold accents, and the Egyptian falcon god Horus.\n\nRise above the rest" },
	["cu_mac10_scarab"] = { name = "Echoing Sands", desc = "It has been custom painted using desert camouflage and environments as inspiration. A scarab has been painted under the wire form butt.\n\n\"WE'VE BEEN SET UP! THEY'RE EVERYWHERE!\"" },
	["gs_mag7_goold"] = { name = "Copper Coated", desc = "It has been custom painted to look like it was held under a stream of liquid copper.\n\nThis was an accident, not a mistake..." },
	["gs_mp7_strone"] = { name = "Sunbaked", desc = "The lines of this custom paint job resemble grooves on a topographical map.\n\nBleed between the lines" },
	["gs_nova_sobek"] = { name = "Sobek's Bite", desc = "This custom paint job features gold and black Egyptian inspired designs.\n\nFrom the water comes chaos" },
	["gs_p250_apep"] = { name = "Apep's Curse", desc = "It has been custom painted using Egyptian patterns and materials as inspiration.\n\nIn opposition of Ra" },
	["hy_dune_trap"] = { name = "Snake Pit", desc = "A custom pattern of snakes and amphibians has been applied.\n\nActing on ill intentions" },
	["cu_p90_scarab_of_wisdom"] = { name = "ScaraB Rush", desc = "It has been custom painted with scarabs and Egyptian inspired designs.\n\nResurrection requires death, and death requires rushing" },
	["gs_ssg08_anubis"] = { name = "Azure Glyph", desc = "It has been custom painted with blue water, Egyptian hieroglyphs, and finished with wood running the length of the weapon.\n\nFlood warning" },
	["cu_tec9_mummy"] = { name = "Mummy's Rot", desc = "It has been custom painted to resemble a mummy. A cobra with green eyes has been painted beneath the rear sight.\n\nKeep this under wraps" },
	["gs_usps_tactical_camo"] = { name = "Desert Tactical", desc = "It has been custom painted with an olive-colored tactical camouflage.\n\nBase models don't have to be boring" },
	["cu_xm1014_pharaoh"] = { name = "Hieroglyph", desc = "It has been custom painted with Egyptian hieroglyphs and ornaments.\n\nThe moral of the story" },
	["sp_nukestripe"] = { name = "sp_nukestripe", desc = "Cette arme a été peinte à la bombe avec des motifs de danger d'alerte radiologique." },
	["sp_spray_waves_bravo"] = { name = "sp_spray_waves_bravo", desc = "Ce souvenir de Seaside a été peint à la main avec de courtes et épaisses lignes de couleurs contrastées.\n\nParfait pour les insurgés pressés" },
	["hy_ocean_bravo"] = { name = "hy_ocean_bravo", desc = "Ce souvenir de Seaside a été personnalisé en utilisant un film hydrographique d'un camouflage bleu.\n\nNotre monde cache beaucoup de choses... mais parfois le camouflage est destiné à être vu - Booth, Marchand d'armes" },
	["sp_spitfire_famas_bravo"] = { name = "sp_spitfire_famas_bravo", desc = "Ce souvenir de Cache a été peint d'après le motif d'une bouche de requin dans le style nose art.\n\nJester est mort" },
	["hy_tile_bravo"] = { name = "hy_tile_bravo", desc = "Ce souvenir d'Ali a été personnalisé en utilisant un film hydrographique d'une mosaïque.\n\nLa patience est une vertu" },
	["an_navy_bravo"] = { name = "an_navy_bravo", desc = "Ce souvenir d'Ali a été peint avec de la peinture transparente bleu marine à effet anodisé sur la base d'une couche de chrome.\n\nJ'ai déjà perdu un homme à cause des mensonges de Valeria... Je ne compte pas en perdre un autre - Felix Riley, Commandant" },
	["sp_hazard_bravo"] = { name = "sp_hazard_bravo", desc = "Ce souvenir de Siege a été peint à la bombe avec des motifs de bandes de danger.\n\nNE PAS TRAVERSER" },
	["sp_tape_dots_bravo"] = { name = "sp_tape_dots_bravo", desc = "Ce souvenir de Gwalior a été peint à la bombe avec des pochoirs tel que du ruban adhésif déchiré et du métal perforé.\n\nT'inquiète pas... Le business va bientôt reprendre - Booth, Marchand d'Armes" },
	["hy_ddpat_bravo"] = { name = "hy_ddpat_bravo", desc = "Ce souvenir de Ruins a été personnalisé en utilisant un film hydrographique d'un camouflage numérique.\n\nMême si vous ne pouvez pas le voir, vous l'entendrez" },
	["so_jungle_bravo"] = { name = "so_jungle_bravo", desc = "Des parties de ce souvenir de Ruins ont été peintes selon un jeu de couleurs jungle.\n\nPour ceux qui ont un appétit pour la destruction" },
	["so_tornado_bravo"] = { name = "so_tornado_bravo", desc = "Des parties de ce souvenir de Cache ont été peintes selon un jeu de couleurs tornade.\n\nLes mots sont du vent, mais le vent peut tuer" },
	["so_sand_bravo"] = { name = "so_sand_bravo", desc = "Des parties de ce souvenir de Cache ont été peintes selon un jeu de couleurs dune de sable.\n\nLe journaliste Gonzo Alex Kincaide a disparu lors de son voyage au Maghreb pour couvrir l'opération Vanguard" },
	["so_olive_bravo"] = { name = "so_olive_bravo", desc = "Des parties de ce souvenir de Cache ont été peintes selon un jeu de couleurs vert olive.\n\nNe jamais prendre la victoire comme acquise" },
	["an_gunmetal_bravo"] = { name = "an_gunmetal_bravo", desc = "Ce souvenir de Siege a été peint avec une peinture à effet anodisé gunmetal sur la base d'une couche de chrome.\n\nTu ne connais pas Felix Riley comme moi... L'homme est impossible à briser - Le Traître et Le Chercheur de Vérité Partie 1" },
	["am_ossify_blue_p2000_bravo"] = { name = "am_ossify_blue_p2000_bravo", desc = "Ce souvenir de Seaside a été personnalisé en utilisant un film hydrographique bleu transparent abstrait sur la base d'une couche métallique.\n\nLes vagues se brisent, pas notre détermination - Kotaro Izaki, Expert en failles" },
	["am_crumple_bravo"] = { name = "am_crumple_bravo", desc = "Ce souvenir d'Agency a été peint avec des peintures métalliques réflectives selon un motif de polygones et sur la base d'une couche de chrome.\n\nCrayons posés, mains en l'air" },
	["aq_steel"] = { name = "aq_steel", desc = "Cette arme est en parfait état de marche, bien qu'elle ait l'air rouillée.\n\nCertaines personnes n'ont pas besoin de cacher l’obscénité de leurs actes" },
	["hy_hex"] = { name = "hy_hex", desc = "Cette arme a été personnalisée en utilisant un film hydrographique aux motifs hexagonaux." },
	["hy_camo_large"] = { name = "hy_camo_large", desc = "Cette arme a été personnalisée en utilisant un film hydrographique aux motifs d'un énorme camouflage." },
	["am_ddpatdense"] = { name = "am_ddpatdense", desc = "Cette arme a été recouverte d'une feuille métallique estampée d'un camouflage numérique." },
