	["snakeskin"] = { name = "snakeskin", desc = "Cette arme a été personnalisée en utilisant un film hydrographique peau de serpent.\n\nJe sais que tu ne crois pas en la cause... Et quand je t'exposerai, Valeria aura ta tête - Le Bouclier et Le Serpent Partie 1" },
	["cu_usp-s_elegant"] = { name = "cu_usp-s_elegant", desc = "Cette arme a été peinte en bleu cobalt tout en laissant, grâce à un pochoir, le logo des Antiterroristes sur le chargeur.\n\nJe peux suivre la procédure et en extraire 7, ou je peux le faire à ma façon et sauver les 10... Ton choix - Carmen Cocinero, Experte en extraction" },
	["hy_plaid2"] = { name = "hy_plaid2", desc = "Cette arme a été personnalisée en utilisant un film hydrographique de motifs à carreaux taupe et bleu-vert.\n\nCe n'est pas une cornemuse, mais ça joue une mélodie avant chaque enterrement" },
	["cu_fiveseven_urban_hazard"] = { name = "cu_fiveseven_urban_hazard", desc = "Cette arme a été personnalisée d'un camouflage urbain et de touches de rouge.\n\nChaque année, Booth rassemble les plus grands armuriers pour présenter leurs dernières créations" },
	["an_emerald"] = { name = "an_emerald", desc = "Cette arme a été peinte avec de la peinture transparente émeraude à effet anodisé sur la base d'une couche de chrome.\n\nC'est donc ce à quoi le grand Sebastien Hennequet a été réduit ? Un instit' hystérique ? Qu'est-ce qui t'es arrivé... - Le Professeur et l'Iconoclaste Partie 2" },
	["so_keycolors"] = { name = "so_keycolors", desc = "Des parties de cette arme ont été peintes selon un jeu de couleurs bleu et orange.\n\nLe grand égaliseur" },
	["cu_awp_mastery"] = { name = "cu_awp_mastery", desc = "Cette arme a été personnalisée en utilisant une combinaison de film hydrographique et de pochoirs minutieusement appliqués et détaillée grâce à des décalcomanies à transfert de chaleur.\n\nChase Turner était un grand homme... Il vous sera difficile de faire aussi bien que lui. – The Phoenix et l'initié, partie 1" },
	["aq_dualberettas_cartel"] = { name = "aq_dualberettas_cartel", desc = "Cette arme a été gravée de motifs de crânes squelettiques et de fleurs et possède une crosse personnalisée.\n\nC'est pourquoi Huxley fait le gros du travail. Tout ce que nous devons faire, c'est l'encourager à aller de l'avant... - Le serpent et le chercheur de vérité, partie 2" },
	["aq_famas_contour"] = { name = "aq_famas_contour", desc = "Cette arme a été personnalisée avec un design moderne rouge et gris, complétant la forme de l'arme.\n\nNous sommes toujours plus forts ensemble" },
	["cu_nova_hyperbeast"] = { name = "cu_nova_hyperbeast", desc = "Cette arme a été personnalisée avec un animal bestial peint aux couleurs psychédéliques.\n\nIls t'appellent The Oni, hein ? Quel nom effrayant pour un homme triste comme toi... – Elliot Kingsman, Mercenaire" },
